(1, 'الجميع يريدون مقابلتك', 'الصين', 'تعرض تشانغ وي ، المدير العام لفندق خمس نجوم ، للضغوط من عمله طوال حياته حتى إلتقى بلوه شي ، الفتاة التي يمكنها أن تخرج تشانغ وي من حالته المشغولة . أُعجب تشانغ وي بجمال ولطافة لوه شي ، وأظهر في النهاية شعور الحب. رأت لوه شي تدريجيًا الجانب اللطيف خلف برود تشانغ وي، تعلقها بتشانغ وي تصاعد تدريجيًا. تاو لون ، يحب لوه شي سرًا ، ولكن في نظر لوه شي ، تاو لون يشبه الأخ الأكبر. في خيبة الأمل ، ركز تاو لون على حياته المهنية ، ووجد ببطء الشعور بالحب مع ليو وين نا.. عندما تخطط مجموعة فنادق قوية لبناء فندق يؤدي إلى تدمير المناظر الطبيعية الجميلة. تعاون تشانغ وي و تاو لون معًا للحفاظ على المناظر الطبيعية الجميلة.', 'https://asia2tv.net/wp-content/uploads/2020/04/ESEzZSkVUAE9n9X.jpg', 0, '03/01/2021', 'Zhang-Zhe-Han : في دور Zhang Min\nZhang-Ruo-Nan : في دور Luo Xi\nRiley-Wang : في دور Tao Lun\nAnna-Hollen : في دور Liu Wen Na\nEssay-Wang : في دور Zhou Mo\nPeng-Bo : في دور Yang Lin', '2KfZhNis2YXZiti5INmK2LHZitiv2YjZhiDZhdmC2KfYqNmE2KrZgyBFdmVyeW9uZSBXYW50cyBUbyBNZWV0IFlvdQ==', 'Shei Dou Ke Wang Yu Jian Ni', '36 حلقة'),
(2, 'يوم ما أو ذات يوم', 'التايوان', 'هوانغ يوشوان امرأة تخسر حبيبها بحادث تحطم طائرة وهي بعمر الـ 27 لتجد نفسها عائدة للماضي كفتاة بالثانوية تُدعى تشين يون رو وتلتقي هناك بفتى زميل لها بالصف يطابق حبيبها الراحل.', 'https://asia2tv.net/wp-content/uploads/2020/04/MV5BOTU0Y2MwOTctYTFmYi00MjlhLTkxYzEtYjdkOWRkNGRhNDVhXkEyXkFqcGdeQXVyMjU1NTY2NTA@-1.jpg', 0, '03/01/2021', 'Alice-Ke : في دور Huang Yu Xuan / Chen Yun Ru\nGreg-Hsu : في دور Li Zi Wei / Wang Quan\nYan-Yu-Lin : في دور Xie Zhi Qi / Xie Zhong\nPatrick-Shih : في دور Mo Jun Jie\nZhang-Guang-Chen : في دور A Tuo\nWen-Yi-Guo : في دور Kun Bu', '2YrZiNmFINmF2Kcg2KPZiCDYsNin2Kog2YrZiNmFIFNvbWUgRGF5IG9yIE9uZSBEYXk=', 'Want to Meet You', '26 حلقة (13)'),
(3, 'حب النوايا الحسنة الموسم الثاني', 'الصين', 'تتحدث دراما “حب النوايا الحسنة” الموسم الثاني عن تعمل “شيا لين”، الممثلة التي حصلت على تصنيف C في الآونة الأخيرة، بجد من أجل تحقيق حلمها في أن تكون نجمة سينمائية مشهورة. تلتقي لين يي زهو ، رئيس مجموعة Ling Group ، وهي شركة متعددة الجنسيات تسيطر على شريان الحياة الاقتصادي في Guangdong. أزمة الرأي العام تدفع الاثنين معا. سواء أكان لقاء مع deja vu أو مؤامرة من قِبل آخرين ، فإن الأعداء السعداء ما زالوا حلوين حتى في حالة مليئة بالحوادث.', 'https://asia2tv.net/wp-content/uploads/2020/04/22Well-Intended-Love-222-Trailer-Features-Entirely-New-Storyline-Weibo2_01.29.20.jpg', 0, '03/01/2021', 'Xu-Kai-Cheng : في دور Ling Yi Zhou\nSimona-Wang : في دور Xia Lin\nIan-Yi : في دور Chu Yan\nHuang-Qian-Shuo : في دور Wen Li\nYang-Hao-Ming : في دور Nan Jin Tian\nLiu-Jia-Xi : في دور Jia Fei', '2K3YqCDYp9mE2YbZiNin2YrYpyDYp9mE2K3Ys9mG2Kkg2KfZhNmF2YjYs9mFINin2YTYq9in2YbZiiBXZWxsIEludGVuZGVkIExvdmUgMg==', 'السيد الرئيس', '16 حلقة'),
(4, 'حب و قدر', 'الصين', 'قصة حب بين لورد الحرب والعذراء الشابة الذي يمكن أن يؤدي وجوده إلى إلحاق الضرر بالعالم.\nقبل عشرة آلاف عام ، سقط جيو تشن ، المعروف باسم لورد الحرب ، في سبات عميق بعد أن ختم اللورد الشيطان. لينغ شي تُوقظه عن غير قصد من نومه ويقعا في الحب. و اكتشف أن لينغ شي قد وُلدت بحُمى شريرة التي يُمكن أن تُساعد اللورد الشيطان على التحرر وتسمح لقبيلة الشيطان بالوصول إلى السلطة.جيو تشن يرفض قتل بريئة ويحاول تغيير مصير لينغ شي. فمن خلال تشجيع جيو تشن ،تتحول لينغ شي التي كانت بريئة وساذجة إلى قائدة شجاعة في معركة ضد الشر .', 'https://asia2tv.net/wp-content/uploads/2020/04/0vy2kf.jpg', 0, '03/01/2021', 'Chang-Chen : في دور Jiu Chen\nNi-Ni : في دور Ling Xi / Lin Mo\nEthan-Li : في دور Jing Xiu\nJessie-Zhang : في دور Qing Yao\nLeo-Li : في دور Yun Feng\nKarina-Hai : في دور Yuan Tong', '2K3YqCDZiCDZgtiv2LEgTG92ZSBhbmQgRGVzdGlueQ==', 'The Fate of Chen Xi', '60 حلقة'),
(5, 'اكتشف ذاتك', 'الصين', 'تروي دراما “اكتشف ذاتك” قصة حب بين امرأة مهنية بارزة ورجل أصغر سنًا منها.', 'https://asia2tv.net/wp-content/uploads/2020/03/p4nWbf.jpg', 0, '03/01/2021', 'Victoria-Song : في دور He Fan Xing\nSong-Wei-Long : في دور Yuan Song\nDavid-Wang : في دور Ye Lu Ming\nZhang-Yu-Jian : في دور He Can Yang\nEsther-Yu : في دور Cai Min Min\nKatherine-Yang : في دور Cong Xiao', '2KfZg9iq2LTZgSDYsNin2KrZgyBGaW5kIFlvdXJzZWxm', 'Zi Shen Shao Nv De Chu Lian', '41 حلقة'),
(6, 'تزلج في الحب', 'الصين', 'فتاة التزلج السريع مع بطل رياضة هوكي الجليد في المدرسة . على الرغم من تعثرهم في البداية الا انهم يبدأون في مطاردة احلامهم . خلال المدرسة الابتدائية ، الخجول و الجبان لي يو بينغ تحمل لوقت طويل تنمر زميلته تانغ شو. و لكنهم رغم ذلك يتشاركون بشيئ واحد و هو الجليد . عندما يتقابلون مجددا في الجامعة . يكون لي يو بينغ قد اصبح بطل الكلية في التزلج و لكن تانغ شو بقيت كسولة . لي يو بنيغ يكون عنيفا جدا معها لكي يساعدها في استعادة حلمها بالتزلج و كل شيئ قد تعلمته . كلما يمضون الوقت معا كلما يلاحظ لو يو بينغ مهارات تانغ شو . حيث يدرك بانه قد أحب التزلج بسببها . بالمقابل سوف يساعدها على تحقيق حلمها الذي تخلت عنه . و لكن بمرور الوقت يصبح لي يو بينغ عاشقا لها ، فكيف سيتقرب من الفتاة التي اعتادت التنمر عليه؟', 'https://asia2tv.net/wp-content/uploads/2020/03/j2QeOc.jpg', 0, '03/01/2021', 'Janice-Wu : في دور Tang Xue\nSteven-Zhang : في دور Li Yu Bing\nZhou-Li-Jie : في دور Yu Yan\nVincent-Wei : في دور Bian Cheng\nHan-Jiu-Nuo : في دور Zhang Yue Wei\nZhang-Lei : في دور Coach Xu', '2KrYstmE2Kwg2YHZiiDYp9mE2K3YqCBTa2F0ZSBJbnRvIExvdmU=', 'Bing Tang Dun Xue Li', '40 حلقة'),
(7, 'ذات مرة في جبل لينغ جيان', 'الصين', 'الدراما تروي قصة شاب عبقري يدعى وانغ لو، الذي يدخل بطائفة روحية ويبدأ في رحلة غير عادية نحو الثقافة والرعاية الخالدة تم إنشاء هذه الطائفة في عام 4233، وخلال عدة سنوات قاموا بابتكار معجزة في فنون القتال، وتم اعتبارها واحدة من أكبر خمس طوائف موجودة، في الوقت الذي تواجه فيه القارات التسعة أزمة كبيرة، فإن انضمام العبقري وانغ لو إلى هذه الطائفة تحت رعاية وانغ وو يزيد كثيراً من هذه الطائفة وعلى الرغم من جمال وانغ وو، إلا أن عمرها مئات السنين وتشتهر بكلماتها الحادة ومزاجها الغريب والمتغير، وتدخل هي وتلميذها الجديد وانغ لو في مشاحنات لا نهاية لها،بينما تسير في الطريق لتصبح أقوى حكيم موجود في جميع البلاد.', 'https://asia2tv.net/wp-content/uploads/2020/02/6L3Ydf.jpg', 0, '03/01/2021', 'Xu-Kai : في دور Wang Lu\nSandrine-Pinna : في دور Wang Wu\nGao-Yu-Er : في دور Feng Ling\nCristy-Guo : في دور Liu Lixian\nRyan-Zhu : في دور Hai Yun Fan\nVeronique-Zheng : في دور Liang Qiu', '2LDYp9iqINmF2LHYqSDZgdmKINis2KjZhCDZhNmK2YbYuiDYrNmK2KfZhiBPbmNlIFVwb24gYSBUaW1lIGluIExpbmdqaWFuIE1vdW50YWlu', 'Cong Qian You Zuo Ling Jian Shan', '37 حلقة'),
(8, 'حب النوايا الحسنة', 'الصين', ' تعقد ممثّلة مصابة بسرطان الدم اتفاق زواج مع مدير تنفيذي شابّ لتضمن تبرّعه لها بنخاعه العظمي… تُرى هل ستعيق مشاعر الحبّ والأسرار طريقها؟', 'https://asia2tv.net/wp-content/uploads/2020/03/QjL4Yf-260x310.jpg', 0, '03/01/2021', ' تعقد ممثّلة مصابة بسرطان الدم اتفاق زواج مع مدير تنفيذي شابّ لتضمن تبرّعه لها بنخاعه العظمي… تُرى هل ستعيق مشاعر الحبّ والأسرار طريقها؟', 'V2VsbCBJbnRlbmRlZCBMb3ZlIC8g2K3YqCDYp9mE2YbZiNin2YrYpyDYp9mE2K3Ys9mG2Kk=', '奈何BOSS要娶我', '20'),
(9, 'شباب لا يتوقف', 'الصين', '.الدراما تحكي قصة مجموعة من الشباب الذين يناضلون من أجل أحلامهم. يواجه فريق مينغ يانغ للكرة الطائرة احتمال الحل بعد هزيمته في بطولات الدوري الأخيرة. يي آنل لاعبة كرة طائرة موهوبة بالفطرة تنضم للفريق. على الرغم من أن زملائها في الفريق يشككون بها في البداية بسبب قصر قامتها وبعض القيود الجسدية، إلا أن لطف يي آنل وشجاعتها ومثابرتها تساعدها على تكوين صداقات قوية على طول الطريق.يكافح الأبطال لقيادة فريق مينغ يانغ إلى الدوري الإقليمي. ومع ذلك، فإن الرحلة نحو أن يكون البطل ليست سهلة كما تبدو. تدخل يي آنل في علاقة معقدة مع لاعب كرة الطائرة يي يانغ، وأخيها وصديق طفولتها فو آنيان وزميلتها في الفريق تشو يوانيا. في ظل الضغوط المتصاعدة، هل مشاكلهم الشخصية ستعرقل عملهم الجماعى؟ وهل ما زال بإمكانهم تحقيق النصر؟', 'https://asia2tv.net/wp-content/uploads/2020/02/unstoppable-youth.jpg', 0, '03/01/2021', 'Alan-Yu : في دور Fu An Yan\nVivi-Miao : في دور Yi An Le\nZhou-You : في دور Ye Man Le\nMaggie-Chen : في دور Qui Yuan Ya\nChen-Wei-Dong : في دور Han Hao\nWang-Nai-Chao : في دور Qi Ze Xiu', '2LTYqNin2Kgg2YTYpyDZitiq2YjZgtmBIFVuc3RvcHBhYmxlIFlvdXRo', 'Unstoppable Love', '40 حلقة'),
(10, 'عشاق دنيا الخيال', 'الصين', 'تحكي الدراما قصة الطبيب الروحاني باي تشي الذي يتجول في العالم ليخلص الأرواح من هاجسهم. في هذه العملية ، يلتقي لين شيا الشمس التي كان يعرفها منذ زمن طويل.\nباي تشي طبيب يكتنفه الغموض في هويته. لديه وظيفة واحدة غير عادية للغاية لاستخدام قوة خارقة للشفاء من الرواح. الأرواح هي بشر ملوثين بالرغبات الدنيوية وفقط بعد الشفاء يمكنهم العودة إلى حياتهم الطبيعية. عن طريق الخطأ ، يلتقي باي تشي بفتاة بشرية تدعى لين شيا تدخل في اتفاق تعايش معه . مع تقاطع حياتهم ، تعود أيضًا الذاكرة التي كانت مختومة منذ آلاف السنين..', 'https://asia2tv.net/wp-content/uploads/2020/01/6L3Ydf.jpg', 0, '03/01/2021', 'Johnny-Bai : في دور Bai Qi\nZheng-Qiu-Hong : في دور Lin Xia\nJi-Xiao-Bing : في دور Yang Jian\nEstelle-Chen : في دور Xiao Xiao\nMarcus-Li : في دور A Li\nXuan-Lu : في دور Ling Long', '2LnYtNin2YIg2KZhtmK2Kcg2KfZhNiu2YrYp9mEIEZhaXJ5bGFuZCBMb3ZlcnM=', 'Peng Lai Jian', '35 حلقة'),
(11, 'أمير التنس', 'الصين', 'تتحدث دراما “أمير التنس” عن “لو شيا”، معجزة تنس عاش في الخارج منذ أن كان طفلاً مع والديه. لقد ورث قوة والده المتميزة وموهبة التنس. ومع ذلك ، فإن “لو شيا”، المحاصر تحت ظل والده، يرى التنس فقط كأداة للفوز عليه، وفقدان الشغف والسعادة في لعب التنس تمامًا.\nعند عودته إلى الصين، انضم إلى فريق التنس في المدرسة الثانوية والتقى بسادة التنس المختلفين. وهنا يبدأ في إدراك معنى التنس ومعرفة هويته كلاعب. في عملية العمل من أجل الفوز بالدوري الوطني ، يتعلم “لو شيا” وزملاؤه العمل كمجموعة وفهم أهمية الأصدقاء.', 'https://asia2tv.net/wp-content/uploads/2020/01/XwDepf.jpg', 0, '03/01/2021', 'Peng-Yu-Chang : في دور Lu Xia\nIreine-Song : في دور Qi Ying\nZhang-Yi-Jie : في دور Zhuo Zhi\nDong-Li : في دور Qiao Chen\nXie-Bin-Bin : في دور Mu Si Yang\nZhu-Zhi-Ling : في دور Chi Da Yong', '2KPZhdmK2LEg2KfZhNiq2YbYsyBUaGUgUHJpbmNlIG9mIFRlbm5pcw==', 'يعرف ايضا بـ:', '40 حلقة'),
(12, 'التساغب', 'التايوان', 'الدراما ستروي قصة فتى في سن العاشرة ، اسمه “تشنغ يو كوان” الذي شهد حادثًا سيغير مسار حياته إلى الأبد.', 'https://asia2tv.net/wp-content/uploads/2020/01/download-3.jpg', 0, '03/01/2021', 'Prince-Chiu : في دور Cheng You Kuan\nLorene-Jen : في دور Bi Ke Zhen\nAndy-Wu : في دور Li Yao Qing\nEleven-Yao : في دور Xu Ming Fei\nMichael-Huang : في دور Xu Zhao De\nZhi-Jie-Di : في دور Dr. He', '2KfZhNiq2LPYp9i62KggQW1lbnNhbGlzbQ==', 'Fu Huo', '13 حلقة'),
(13, 'جاري لا يستطيع النوم', 'الصين', 'رومانسية لطيفة تبدأ عندما يجد عازف بيانو يعاني من الأرق الراحة في روائية رومانسية غريبة سونغ مي دو التي كانت عزباء منذ الولادة، تعمل كروائية رومانسية طموحة تحلم بالشهرة أثناء الصيف، بعد تخرجها من الثانوية، تقابل شي سونغ، عازف بيانو أصبح مشهوراً في سن صغيرة، وبسبب الضغط الذي يواجهه، يعاني شي سونغ من الأرق ولكنه يُفاجأ بإدراكه أن بإمكانه النوم عندما تكون سونغ مي دو بجانبه باستخدام شي سونغ كعارضها، تصبح سونغ مي دو عازمة على كتابة قصة حب ستغزو العالم، ويُعد الإثنان اتفاقاً بأن كلاهما سينتفع من الآخر، وبالتالي بدء تنسيق نوم فريد وهما يلاحقان أحلامهما.', 'https://asia2tv.net/wp-content/uploads/2020/04/My-Neighbor-Cant-Sleep-Stills-MB8nW7GlLB.jpg', 0, '03/01/2021', 'Wang-Zi-Xin : في دور Xi Song\nChen-Yi-Xin : في دور Song Mi Duo\nMars-Ma : في دور Liang Ge\nAlina-Zhang : في دور So Mi Do mama\nDamon-Xue : في دور Lu Yiyou', '2KzYp9ix2Yog2YTYpyDZitiz2KrYt9mK2Lkg2KfZhNmG2YjZhSBNeSBOZWlnaGJvdXIgQ2Fu4oCZdCBTbGVlcA==', 'Wo De Lin Ju Shui Bu Zhao', '24 حلقة'),
(14, 'الشباب الحماسيون', 'الصين', 'الدراما تروي قصة أسطورية عن شباب من أحياء الصفيح الفقيرة يتغلبون على العديد من التحديات والمصاعب ليصبحون قوة هائلة في شنغهاي.', 'https://asia2tv.net/wp-content/uploads/2019/11/c9bb62b29820449db33b49a5789e8094.jpeg', 0, '03/01/2021', 'Z-Tao : في دور Wu Qian\nSophie-Zhang : في دور He Hongyi\nLiu-Yuning : في دور Wei Chengfeng\nCao-Xiyue : في دور Wu Xiaoxiao\nWang-Jinsong : في دور Sang Jieqiao\nZhang-Fan : في دور Wu Fatian', '2KfZhNi02KjYp9ioINin2YTYrdmF2KfYs9mK2YjZhiBIb3QgQmxvb2RlZCBZb3V0aA==', 'The Files of Teenagers in the Concession', '58 حلقة'),
(15, 'غطـس الشباب', 'الصين', 'المدربة فينغ يو يائسة للحصول على طريقة لمنع تفكك فريق الغوص خاصتها و لكن بسبب الدعم القليل من المحيطين بها فإن المهمة صعبة جدا . اذا كانت تريد الحفاظ على ناديها الثمين ، يجب عليها جمع لاعبين ماهرين لذا فإن المدربة يو تنطلق لاجل فعل هذا . رغم ان البحث عن اللاعبين ليس سهلآ و لكن في نهاية المطاف يمد لها القدر يد العون حيث لا يجلب لها لاعب واحد و انما اربعة شباب موهوبين في رياضة الغطس جيانغ باي لونغ بطل عالمي في رياضة الغطس و سون ويت طالب اجنبي من تايلند و النجم الواعد في هذه الرياضة لو هاوران و شريكه تيان لين . المدربة يو واثقة من نجاح فريقها . و لكن هل سيكون الفوز حليف هذا الفريق بالنهاية؟', 'https://asia2tv.net/wp-content/uploads/2019/11/Plop_Youth-Youku-13.jpg', 0, '03/01/2021', 'Jason-Koo : في دور Jiang Bai Long\nNon-Chanon-Santinatornkul : في دور Wei Te\nXu-Ke-Long : في دور Han Cai Ti\nJudy-Qi : في دور Mi Nan\nSun-Wei-Hao : في دور Lu Hao Ran\nWong-Fann : في دور Cen Ling', '2LrYt9mA2LMg2KfZhNi02KjYp9ioIFBsb3AgWW91dGg=', 'Dive / Plop of Youth', '30 حلقة'),
(16, 'حب تحت القمر', 'الصين', 'بالوقوع في مثلث حب غير متوقع وفوضوي، يجب على شيانغ يوان اكتشاف طريقة للتغلب على عقبات الحياة والحب بالتمسك بالشيء الوحيد الذي دفعها دائمًا للأمام..أحلامها', 'https://asia2tv.net/wp-content/uploads/2019/10/download-7.jpg', 0, '03/01/2021', 'Ou-Hao : في دور Ye Qian Ze\nVictoria-Song : في دور Xiang Yuan\nXia-Ning-Jun : في دور Ye Yun\nDanson-Tang : في دور Chen Ju An\nSun-Yi : في دور Dong Ling\nDing Yong-Dai : في دور Ye Bing Lin', '2K3YqCDYqtit2Kog2KfZhNmC2YXYsSBMb3ZlIFVuZGVyIHRoZSBNb29u', 'Being Lonely in Love', '48 حلقة'),
(17, 'حبيبتي', 'الصين', 'تدور أحداث الدراما حول “دينغ شياو رو” التي تبلغ من العمر 17 عاما، كانت شياو رو تعتقد أنها ملعونة منذ الصِغر لأن جميع علاقاتها الرومانسية تفشل واحدة تلو الأخرى … حتى تلتقي ذات يوم بـ “تشي شين” مما يؤدي إلى بداية رومانسية غريبة.', 'https://asia2tv.net/wp-content/uploads/2019/10/71668381_600292644109044_7806435087184007038_n.jpg', 0, '03/01/2021', 'Timmy-Xu : في دور Chi Xin\nBridgette-Qiao : في دور Ding Xiao Rou\nZhou-Yi-Xuan : في دور Zheng Ze\nTang-Wei : في دور Ding Xiao Rou\nWang-Jia-Ning : في دور Nan Sa Sa', '2K3YqNmK2KjYqtmKIE15IEdpcmxmcmllbmQ=', 'Miss Unlovable', '28 حلقة'),
(18, 'العالم يدينني بحب أول', 'الصين', 'الدراما تحكي قصة حب من منظور ثلاثي الأبعاد لفتاة شابة طموحة مستقلة مليئة بالامكانيات وابن وريث يرفض القيام بأعمال اسرته ويفضل القيام بعمله المنفرد كمصمم لالعاب الهاتف والذي يقوم بتعيينها في الشركة، و لسبب ما تمر الفتاة بالعديد من العقبات مع رئيسها الغريب.', 'https://asia2tv.net/wp-content/uploads/2019/10/D7AjAxFUYAAYsBO.jpg', 0, '03/01/2021', 'Bai-Lu : في دور Xing Yun\nXing-Zhao-Lin : في دور Xia Ke\nAnna-Hollen : في دور Yao Qing\nZhai-Zi-Lu : في دور He Yu\nLiu-Ruo-Yan : في دور Shen Qing\nHuang-Ji-Dong : في دور Chu Nan', '2KfZhNi52KfZhNmFINmK2KZitmG2YbZiiDYqNit2Kgg2KPZiNmEIFRoZSBXb3JsZCBPd2VzIE1lIEEgRmlyc3QgTG92ZQ==', 'Lucky’s First Love', '24 حلقة'),
(19, 'الفتى موكلي', 'الصين', 'نشأ “مو جي لي” في البرية مع جده، وقد قضى حياته كلها محاطا بالطبيعة، غافلا تماما عن العالم الخارجي بالرغم من وجود جده والحيوانات التي يسميها أصدقائه، لكن كل ذلك يتغير عندما تدخل فيه “لينغ شي” حياته .\nتجتمع “لينغ تشي” وهي إمرأة عصرية ومستقلة في لقاء مع “مو جي لي” دون قصد وتجلبه إلى المنزل معها وتدرك للاسف أن عليها إعادة هذا الرجل الى منزله في أسرع وقت ممكن، وتبذل قصارى جهدها ولكن يبدو أن لا شيء يسير كما ينبغي له، من بين الخيارات المتاحة، تقوم “لينغ تشي” بالشيء الوحيد الذي يُمكنها القيام به، بأن تسمح لـ “مو جي لي” بالبقاء معها حتى تتمكن من إيجاد طريقة لنقله إلى المنزل لكن العيش تحت سقف واحد يغير الكثير من الأمور بينهما هل يُمكن لصبي من البرية وفتاة من العالم المعاصر إيجاد طريقة للجمع بين عالميهم أو ستفرق بينهم الخلافات؟', 'https://asia2tv.net/wp-content/uploads/2019/10/My-Mowgli-boy.jpg', 0, '03/01/2021', 'Ray-Ma : في دور Mo Ge Li\nYang-Zi : في دور Ling Xi\nFu-Meng-Po : في دور Lu Zi Yue\nMing-Ren : في دور Zheng Li\nHuang-Cancan : في دور Tang Cheng\nWang-Zhen-Er : في دور Bai Yi Ling', '2KfZhNmB2KrZiSDZhdmI2YPZhNmKIE15IE1vd2dsaSBCb3k=', 'Wo De Mo Ge Li Nan Hai', '50 حلقة'),
(20, 'ليلة أبدية', 'الصين', 'تتحدث دراما “ليلة أبدية” عن صبي صغير يدعى “نينغ تشيو” الذي نجى بأعجوبة بعد أن تم ذبح عائلته بشكل ظالم من قبل جنرال كبير، نجح في البقاء في البراري من خلال ذكائه ومطاردة قطاع الطريق.\nفي يوم ما وجد فتاة صغيرة بين كومة من الجثث ،اسمها “سانغ سانغ”. منذ ذلك اليوم لا يمكن أن يبتعدا عن بعضهم. انضم بعدها “نينغ” إلى جيش الحدود وأصبح في نهاية المطاف جزءًا من حاشية الأميرة “لي يو” أثناء عودتها إلى العاصمة. وتمكن من دخول مدرسة تانغ واكتشاف المكان المخفي هناك ، مما أدى به و”سانغ سانغ” إلى العديد من المغامرات الرائعة.', 'https://asia2tv.net/wp-content/uploads/2019/10/Ever_night_poster.jpeg', 0, '03/01/2021', 'Arthur-Chen : في دور Ning Que\nIreine-Song : في دور Sang Sang\nAdam-Cheng : في دور Fuzi, the Master\nCrystal-Yuan : في دور Mo Shan Shan\nZoey-Meng : في دور Ye Hong Yu\nKris-Sun : في دور Prince Long Qing of Yan', '2YTZitmE2Kkg2KPYqNiv2YrYqSBFdmVyIE5pZ2h0', 'Ever Night: War of Brilliant Splendours', '60 حلقة'),
(21, 'حبيبي الآلي', 'الصين', 'قصة عن شاب يمكنه قراءة عقول الناس ومحامية لا قيمة لها يحمون بعضهم البعض. تدور هذه القصة حول طالب في كلية الطب الذي يتعرض لحادث ويتلقى التحسينات الميكانيكة المزروعة في جسده من قبل والده. فينتج ذلك الرجل الذي هو نصف إنسان ونصف آلي ومعاناته عندما يتعلق الأمر بالرومانسية، والعائلة، والصداقة. بفضل لقاء غير مقصود، تقع المتدربة الصحفية جيانج مينج يان في حب لين مو باي من النظرة الأولى وتبدأ بالسعي من طرف واحد للفوز بقلبه. وأثناء القيام برحلة طبية إلى بينجتشوان، تعرض لي مو باي لحادث خطير. ويعيد والده العالم لين سي تان تشكيل جزء من جسد لي مو باي ليخضع للذكاء الاصطناعي. يبدأ لقاء مينج يان ومو باي بقصة حب مع العديد من التقلبات.', 'https://asia2tv.net/wp-content/uploads/2019/10/my-robot-boyfriend.jpg', 0, '03/01/2021', 'Rachel-Mao : في دور Jiang Meng Yan\nJiang-Chao : في دور Lin Mo Bai\nWang-Jing-Yan : في دور Zhao Bo Ya\nHuang Yang Tian Tian : في دور Meng Yan (young)\nLiu-Luo-Xi : في دور Hai Ling\nMeng-Zi-Di : في دور Xu Da Lu', '2K3YqNmK2KjZiiDYp9mE2KLZhNmKIE15IFJvYm90IEJveWZyaWVuZA==', 'Wo De Ji Qi Ren Nan You', '42 حلقة'),
(22, 'حب بواسطة التنويم المغناطيسي', 'الصين', 'تروي الدراما قصة أمير وأميرة لا يطيقان النظر في وجه بعضهما البعض يجدون أنفسهم عالقين في زواج مدبر لكنهم يبدأون بالتقرب من بعضهما من خلال التنويم المغناطيسي.\nلي مينج يوي أميرة، ولي تشيان أمير، إنهما مجبران على الزواج من بعضهما البعض بسبب الالتزامات الملكية. عندما تنطلق ذكريات من ماضيه من خلال استخدام التنويم المغناطيسي يبدأ لي تشيان بقبول زوجته عندما عَلِمَ أنها يمكنها مساعدته على استعادة ذكرياته.', 'https://asia2tv.net/wp-content/uploads/2019/10/download-5.jpg', 0, '03/01/2021', 'Alen-Fang-Yilun : في دور Li Qian\nLing-Meishi : في دور Li Mingyue\nLawrence-Zhang-Bohan : في دور Li Xun\nZhou-Zixin : في دور Qiao Huixin\nDong-Yanlei : في دور Si Kongzhen\nNi-Hanjin : في دور Yun Ci', '2K3YqCDYqNmI2KfYs9i32Kkg2KfZhNiq2YbZiNmK2YUg2KfZhNmF2LrZhtin2LfZitiz2YogVGhlIExvdmUgYnkgSHlwbm90aWM=', 'Ming Yue Zhao Wo Xin', '40 حلقة'),
(23, 'العروس الشبح', 'التايوان', 'في تسعينيات القرن التاسع عشر في “مالاكا”، تجد “لي لان” نفسها في الحياة الآخرة وتتورط في جريمة غامضة ترتبط بالابن المتوفي الشرير لعائلة ثرية.', 'https://asia2tv.net/wp-content/uploads/2020/04/zksazsz.jpg', 0, '03/01/2021', 'Huang-Pei-Jia : في دور Pan Li Lan\nChris-Wu : في دور Er Lang\nLin-Lu-Di : في دور Lim Tian Bai\nKuang-Tian : في دور Lim Tian Ching\nJanet-Hsieh : في دور Mrs. Pan\nTeresa-Daley : في دور Isabel', '2KfZhNi52LHZiNizINin2YTYtNio2K0gVGhlIEdob3N0IEJyaWRl', 'Bi An Zhi Jia', '06 حلقات'),
(24, 'أنت غايتي من الحب', 'الصين', 'قصة مليئة بالضحك تتبع مقاتلة الساندا جو شياو مان وعبقري المدرسة تشو آن وهما يطاردان الحب.\nالتخرج يقترب بسرعة من طالبة السنة الثالثة جو شياو مان. على عكس فتاة المدرسة المتوسطة، فهي مقاتلة ساندا تفوز بالميداليات في الرياضة ولكن ليس في الصف. لأنها تريد أن تظل في نفس المدرسة مع حبيبها تشو آن، تقرر بذل نفس الجهد الذي تبذله في الساندا لكن في الدراسة. إن عملها الشاق مع الجهود التي بذله تشو ان بكونه معلمها الخاص تؤتي ثمارها ويدخلان نفس الجامعة. لا يوجد شيء أكثر روعة من أن تتبادل الحب مع من تحب وتستمر القصة.', 'https://asia2tv.net/wp-content/uploads/2020/04/All-I-Want-For-Love-Is-You-Poster3.jpg', 0, '03/01/2021', 'Liu-Yu-Han : في دور Zuo An\nLu-Zhao-Hua : في دور Gu Xiao Man\nLiu-Yin-Jun : في دور Zhan Yue\nXie-Zhi-Xun : في دور Shen Chen Yang\nHan-Xin-Yu : في دور Sun Anning\nHu-Cai-Hong : في دور Zuo An’s Mother', '2KPZhtiqINi62KfZitiq2Yog2YXZhiDYp9mE2K3YqCBBbGwgSSBXYW50IGZvciBMb3ZlIGlzIFlvdQ==', 'Je T’aime Bien Aussi', '32 حلقة'),
(25, 'ألمع نجم في السماء', 'الصين', '“القصة تدور حول 3 أشخاص في سن الشباب يعملون بجد معا للسعي لطومحاتهم الموسيقية.\nهوانع زي تاو” يلعب دور أيدول مغني دون قيود، متمرد ذو شعبية الذي نجح في مهنته وكرس نفسه بشغف للموسيقى. هنالك درجة ما من التشابه لشخصية تاو ذاته. بالنسبة لـ “وو تشيان” فهي تلعب دور مديرة مبتدئة تبدأ من القاع و تعاني من الكثير من الإنتكاسات المتكررة بسبب سوء فهم. لاتستسلم أبدا عن طموحاتها في الموسيقى وتصبح في النهاية مديرة ناجحة من خلال عملها الجاد.', 'https://asia2tv.net/wp-content/uploads/2020/04/0-3.jpg', 0, '03/01/2021', 'Z-Tao : في دور Zheng Bai Xu\nJanice-Wu : في دور Yang Zhen Zhen\nNiu-Jun-Feng : في دور Yu Zi Rui\nCao-Xi-Yue : في دور Xia Yuan\nWang-Jin-Song : في دور Zheng Wei Jun\nLiu-Jia-Yuan : في دور Support Role', '2KPZhNmF2Lkg2YbYrNmFINmB2Yog2KfZhNiz2YXYp9ihIFRoZSBCcmlnaHRlc3QgU3RhciBpbiB0aGUgU2t5', 'Ye Kong Zhong Zui Shan Liang De Xing', '44 حلقة'),
(26, 'اكادمية الترسانة العسكرية', 'الصين', 'تلتحقُ شيه شيانج بالجيش بدلاً من أخيها عبر التظاهر بكونها رجلاً. كما تصبحُ بعدها زميلةً لزميلها الثرى جو يان تشين و الآخر الهادئ شين جون شان. فتنشأ حينها رابطةً وثيقةً بين الطلاب الثلاثةُ خلال إنجازهم لتدريباته الصارمةُ مما يجعلهم رفاقاً فى السلاح، و كل ذلك يحدثُ بينما تحاول شيه شيانج بالمُحافظةِ على هويتها السريةُ. لكن بعد وقوع العديد من الأحداث، تحظىّ شيه شيانج بإحترام أقرانها و رؤسائها. كما تصبحُ أيضاً موضعاً لعاطفةِ رجلين بحياتها. و تتمركزُ لاحقاً المزيد من قوات الجيش اليابانىّ بالمنطقةِ الشماليةُ الشرقيةُ مما يؤدىّ إلى إشتراك الأبطال الشباب فى خوضْ المعركةِ لدىّ إكتشافهم لوجود مؤامرةً كبيرةً.', 'https://asia2tv.net/wp-content/uploads/2019/09/download-6.jpg', 0, '03/01/2021', 'Bai-Lu : في دور Xie Xiang / Xi Liang Che\nXu-Kai : في دور Gu Yan Zheng\nToby-Lee : في دور Shen Jun Shan\nWu-Jia-Yi : في دور Qu Man Ting\nGao-Yu-Er : في دور Jin Xian Rong\nWang-Yi-Zhe : في دور Ji Jin', '2KfZg9in2KZhdmK2Kkg2KfZhNiq2LHYs9in2YbYqSDYp9mE2LnYs9mD2LHZitipIEFyc2VuYWwgTWlsaXRhcnkgQWNhZGVteQ==', 'Lie Huo Jun Xiao', '48 حلقة'),
(27, 'الولوج لذاكرتك', 'الصين', 'تحاول الطباخةُ المُساعدةُ بمُعاونةِ رئيسها على إسترجاع ذكرياته لعامٍ مضىّ. و بأثناء تلك العمليةِ، يتفاهمون فيما بينهم، يُساعد كلاً منهما الآخر و يقعونّ فى حبْ بعضهم البعض.', 'https://asia2tv.net/wp-content/uploads/2019/09/download-4.jpg', 0, '03/01/2021', 'Cecilia-Boey : في دور An Ning\nEden-Zhao-Zhiwei : في دور Long Ziteng\nTiffany-Zhong-Qi : في دور Xia Tian\nWang-Zhuocheng : في دور Yi Mingjun\nWei-Wei : في دور Zhan Zhao\nZhang-Shuangli : في دور Zhan Zhao', '2KfZhNmI2YTZiNisINmE2LDYp9mD2LHYqtmDIFdhbGsgSW50byBZb3VyIE1lbW9yeQ==', 'Zou Jin Ni De Ji Yi', '24 حلقة'),
(28, 'قبل ان نتزوج', 'التايوان', '“تشو وى” على وشك الزواج من خطيبها المخلص والناجح. وتأمل صديقة “تشو كيهوان” التي تحبه منذ 10 سنوات ان تعقد خطبتها معه، لكن هناك عقبة واحدة فقط على الرغم من نواياهم وخططتنهم المختلفة.\nيبدو أن لديهم خطط أخرى.. هل سيلتزمون بها ؟ أو هل سيستسلمون للعاطفة؟.. دراما رومانسية متوترة عن الحب والصداقة والخيانة.', 'https://asia2tv.net/wp-content/uploads/2019/08/images-2.jpg', 0, '03/01/2021', 'Jasper-Liu : في دور Chu Ke Huan\nPuff-Kuo : في دور Zhou Wei Wei\nSteven-Sun : في دور Li Hao Yi\nNita-Xia : في دور Gao Zi Yuan\nPhoebe-Yuan : في دور Han Ke Fei\nMu-Chen : في دور Yan Bai Yang', '2YLYqNmEINin2YYg2YbYqtiy2YjYrCBCZWZvcmUgV2UgR2V0IE1hcnJpZWQ=', 'We Cannot Be Friends', '13 حلقة'),
(29, 'غير متوقع', 'الصين', 'كاتب مانجا يدخل كتابه الهزلي “حب البلورة” وعليه إتمام مهمة إنقاذ الشخصية الثانوية حتى يعود إلى العالم فينتهي به الأمر بملء فراغات قصته مراراً وتكراراً ويخلق قصة حب طريفة.', 'https://asia2tv.net/wp-content/uploads/2019/08/download-9.jpg', 0, '03/01/2021', 'Austin-Lin-Bo-Hong : في دور He Xie\nLi-Haofei : في دور Lu Zixing\nHuang-Junjie : في دور Gong Cheng\nHuang-Yilin : في دور Pei Encai\nZhang-Jinming : في دور Su Zixu\nEryixuan-Wang : في دور Bai Lian', '2LrZitixINmF2KrZiNmC2LkgVW5leHBlY3RlZA==', 'Lai Dao Ni De Shi Jie', '23 حلقة'),
