(31, 'عندما تقع حلزونة في الحب', 'الصين', 'يتحدث مسلسل “عندما تقع حلزونة في الحب” عن ضابط الشرطة “جي باي” وأخصائيّة علم النّفس الجنائي الذكية “شو شو”. تمّ وصف البطلة على أنّها حلزونة صغيرة بسبب عدم امتلاكها لذكاء عاطفي قوي اطّلعوا على تعريف الذكاء العاطفي “هنا” المهم، سيلعب البطل دور مرشد البطلة وهكذا ستتطور علاقتهما لتتحوّل لعلاقة حبّ قويّة. ليس هذا كلّ شيء، الدراما بالأساس ستتمحور حول الحب والتّحقيقفالبطلان سيعملان معا على حلّ قضايا مستعصية جدّا.', 'https://asia2tv.net/wp-content/uploads/2019/08/62c41c304aa6b9c9dadd713a646cd6224e9d13d7r1-690-1034v2_hq.jpg', 0, '03/01/2021', 'Olivia-Wang : في دور Xu Xu\nWang-Kai : في دور Ji Bai\nYu-Heng : في دور Zhao Han\nXu-Yue : في دور Yao Meng\nZhang-Lu : في دور Su Mu\nLi-Long-Jun : في دور Liang Yu/Hou Zi', '2LnZhtiv2YXYpyDYqtmC2Lkg2K3ZhNiy2YjZhtipINmB2Yog2KfZhNit2KggV2hlbiBhIFNuYWlsIEZhbGxzIGluIExvdmU=', 'يعرف ايضا بـ:', '21 حلقة'),
(32, 'في مهب الريح', 'الصين', 'متسلقة جبال تدعى “لي فينغ” تقضي الكثير من وقتها بالاستمتاع بجمال الجبال التي تحبها. لكنها الآن اصبحت طالبة كلية في قسم المعمار تحاول اعادة بناء فريق التسلق و لكنها تحتاج الى مدرب ، فتحاول جعل “شيا دي” الذي هو ايضا متسلق محترف ان يصبح مدربها و لكنه شخص بارد و عنيد و لكن سرعانما ما يصبحون اصدقاء فتتحول الصداقة مع الوقت الى حب و لكن يصدف انهما مشتركان بحادث من الماضي ، فهل سيستمر حبهما ؟', 'https://asia2tv.net/wp-content/uploads/2019/08/D91JcLRUcAEn5SW.jpg', 0, '03/01/2021', 'Xing-Zhao-Lin : في دور Xia Di\nEleanor-Lee : في دور Lin Feng\nNon-Chanon-Santinatornkul : في دور Chen Yi Lu\nXiang-Hao : في دور Bao Yun\nRen-Bin : في دور Sun Li Ming\nChih-Tian-Shih : في دور Fan Yang', '2YHZiiDZhdmH2Kgg2KfZhNix2YrYrSBCbG93aW5nIGluIHRoZSBXaW5k', 'Qiang Feng Chui Bi', '28 حلقة'),
(33, 'في أعماق قلبي', 'الصين', 'تروي الدراما قصة كشف الغموض عن رجل له قدرات خاصة وامرأة ذات شخصية مزدوجة، يجتمع الاثنان بعد أن تم اقتيادهما بطريق الخطأ إلى قضية قتل متسلسل.. يعملون معا جنبا إلى جنب مع صديقهم المحقق شو جاو شينج للقبض على الجاني الحقيقي.', 'https://asia2tv.net/wp-content/uploads/2019/08/download-13.jpg', 0, '03/01/2021', 'Zhou-Chen-Gao : في دور Kong Yi Fei\nNina-Wang : في دور Han Bing\nCaesar-Li : في دور Xu Gao Sheng\nCui-Xin-Xin : في دور Zheng Xiao Zhen', '2YHZiiDYo9i52YXYp9mCINmC2YTYqNmKIERlZXAgaW4gTXkgSGVhcnQ=', 'Wo Xin Shen Chu', '28 حلقة'),
(34, 'هيا هيا يا حبار', 'الصين', 'الدراما تروي قصة حب لطيفة بين مغنية محببة تقع في حب مهندس كمبيوتر عبقري وأسطورة في عالم الألعاب.', 'https://asia2tv.net/wp-content/uploads/2019/08/RAVoof.jpg', 0, '03/01/2021', 'Yang-Zi : في دور Tong Nian\nLi-Xian : في دور Han Shang Yan\nHu-Yi-Tian : في دور Wu Bai\nLee-Hong-Chi : في دور Mi Shao Fei\nLi-Ze-Feng : في دور Wang Hao\nChen-Xi-Jun : في دور Ou Qiang', '2YfZitinINmH2YrYpyDZitinINit2KjYp9ixIEdvIEdvIFNxdWlk', 'Honey Stewed Squid', '41 حلقة'),
(35, 'الجامحون', 'الصين', 'تحكم عشيرة ون القوية العالم المهزوم، وتُهيمِن على الأسر الأصغر حجمًا في كل من لان وجيانغ ونيه وجين. يصبح وي وو شيان صديقًا لسيد وان وانج جي، وخلال مغامراتهم، اكتشفا أن رئيس عشيرة وين هو العقل المدبر الشرير وراء سلسلة من المؤامرات التي ستلحق الدمار بالأراضي.. محاولات وي وو شيان لحماية الأبرياء من عشيرة ون من الاضطهاد الغير عادل تؤدي إلى كارثة، تذهب ميا ضحية في هذه العملية. ظهر وي وو شيان مرة أخرى بعد 16 عامًا، ويعمل مع صديقه الجيد لان وانج جي لحل قضية قتل متسلسل، وفي النهاية يجدا الجاني الحقيقي ويهزمانه.', 'https://asia2tv.net/wp-content/uploads/2019/08/download-15.jpg', 0, '03/01/2021', 'Xiao-Zhan : في دور Wei Wu Xian\nWang-Yi-Bo : في دور Lan Wang Ji\nZoey-Meng : في دور Wen Qing\nXuan-Lu : في دور Jiang Yan Li / Yunmeng\nLiu-Hai-Kuan : في دور Lan Xi Chen / Lan Huan\nWang-Zhuo-Cheng : في دور Jiang Cheng / Yunmen', '2KfZhNis2KfZhdit2YjZhiBUaGUgVW50YW1lZA==', 'Grandmaster of Demonic Cultivation', '50 حلقة'),
(36, 'صديقي الحقيقي', 'الصين', 'تدور أحداث الدراما حول “تشنج تشن تشن” الفتاة ذات الشخصية الواضحة و “شاو بنغ تشنغ” الشاب الذي يخفي هويته الحقيقية باعتباره الابن الوحيد لرئيس الشركة .. يتقدمون للعمل في شركة “الحب والأسرة” كمعاونين مبتدئين، يتم تعيينهم كشريكان في العمل .. فيتعلمون أشياء كثيرة عن الحب والحياة.', 'https://asia2tv.net/wp-content/uploads/2019/08/download-14.jpg', 0, '03/01/2021', 'Angelababy : في دور Cheng Zhen Zhen\nDeng-Lun : في دور Shao Peng Cheng\nZhu-Yi-Long : في دور Jing Ran\nDaniela-Bessia : في دور Italian Ayi\nXu-Hao : في دور Miss Lu\nTan-Kevin : في دور Mu Yun Ping', '2LXYr9mK2YLZiiDYp9mE2K3ZgtmK2YLZiiBNeSBUcnVlIEZyaWVuZA==', 'My Real Best Friend', '48 حلقة'),
(37, 'النصف المفقود', 'تايوان', 'يتحدث مسلسل “النصف المفقود” عن حادث سيارة ورسائل خفية وأسرار خفية من الماضي. قد تبدو “سو يان” مشرقة ومبهجة من الخارج ولكن في الداخل هي امرأة شابة تشعر بعدم الأمان وترفض الانفتاح، غالبًا ما تختلف مع أسرتها وأصدقائها. من خلال دعم وعناية صديقها “لو جين يو”، تقرر “سو يان” إرسال رسائل إلى صديقاتها عشية زواجها لكشف مشاعرها الصادقة وحقيقة عن الماضي. الحروف تفتح الذكريات القديمة، ولكن يقع حادث في وقت غير متوقع.', 'https://asia2tv.net/wp-content/uploads/2019/08/download-12.jpg', 0, '03/01/2021', 'Huang-Pei-Jia : في دور Su Yan\nAnson-Chen : في دور Lu Jin Yu\nJC-Lin : في دور Su Ming Yang\nDara-Hanfman : في دور Han Juan Juan\nEdison-Wang : في دور Sun Yi', '2KfZhNmG2LXZgSDYp9mE2YXZgdmC2YjYryBUaGUgTWlzc2luZyBIYWxm', 'Finding the Order Half', '14 حلقة'),
(38, 'ابنة اللهب', 'الصين', 'تتحدث دراما “ابنة اللهب” عن “يو لوه” الذي عمت الكراهية قلبه بعد أن تزوجت المرأة التي يحبها برجل آخر يدعى “زان فاي تيان”. لذلك قام بإختطاف إبنتها حديثة الولادة، وترعرعت مع إبنه في القصر، الوريث الوحيد للقصر، وينضم إليهم “زان قنغ” و “يو زي هان” التي ولدت كعضو في العائلة الملكية بدون القدرة على المشي، حيث يكبر الطلاب الثلاثة وهم يتدربون على فنون القتال في القصر. بينما تقع “يو زي هان” في الحب، تعرف الطفلة عائلتها الحقيقية. وأن الذي كانت تعتقد أنه والدها تعرف أنه هو المسؤول عن موت عائلتها، وهنا تصاب بالصدمة وتقابل الرجل الذي سيكرس نفسه من أجل حمايتها', 'https://asia2tv.net/wp-content/uploads/2019/08/Poster-The-Flames-Daughter-1.jpg', 0, '03/01/2021', 'Dilraba-Dilmurat : في دور Lie Ru Ge\nVic-Chou : في دور Yin Xue\nVin-Zhang : في دور Zhan Feng\nWayne-Liu : في دور Yu Zi Han\nRyan-Zhang : في دور Lei Jing Hong\nDaisy-Dai : في دور Dao Lie Xiang', '2KfYqNmG2Kkg2KfZhNmE2YfYqCBUaGUgRmxhbWXigJlzIERhdWdodGVy', 'Shallow Lover', '52 حلقة'),
(39, 'راية نسر نوفولاند', 'الصين', '“لو غوي تشن” هو وريث قبيلة تشنغ يانغ البدوية، ويُرسل إلى الأرض الشرقية كرهينة. يلتقي بـ “غي يي” ، الابن غير الشرعي غير المجهز الذي يتدرب ليصبح محاربًا ، و “يو ران” ، أميرة القبيلة المجنحة. أصبح الثلاثة أصدقاء مقربين، وسرعان ما أصبحت مشاعر الصبيان لـ”يو ران” رومانسية. في الوقت نفسه، حافظ أمير الحرب القوي “يينغ وو يي” على سيطرة قوية على الإمبراطور، ما منحه سلطة غير مسبوقة على النبلاء. قرر كل من “لو غوي تشن” و “غي يي” الانضمام إلى المعركة الحاسمة ضد “يينغ وو يي” في ممر (شانغيانغ).', 'https://asia2tv.net/wp-content/uploads/2019/08/maxresdefault.jpg', 0, '03/01/2021', 'Turbo-Liu : في دور Lu Gui Chen\nLareina-Song : في دور Yu Ran\nChen-Ruo-Xuan : في دور Ji Ye\nZhang-Zhi-Jian : في دور Lei Bi Cheng\nLi-Guang-Jie : في دور Xi Yan\nXu-Qing : في دور Grand Princess Bai Li', '2LHYp9mK2Kkg2YbYs9ixINmG2YjZgdmI2YTYp9mG2K8gTm92b2xhbmQgRWFnbGUgRmxhZw==', 'Jiu Zhou Piao Miao Lu', '70 حلقة'),
(40, 'الأميرة التي لا تنام', 'الصين', 'تتحدث دراما “الأميرة التي لا تنام” عن أميرة غير مرغوب فيها تعاني من الأرق وجنرالًا ذا وجه حجري في مهمة لتتبع سبب وفاة شقيقه، كان مصيرهما أن يلتقوا، مما أدى إلى إشعال قصة حب لطيفة ومؤلمة للقلب. عانت الأميرة التاسعة “تشويه” تاريخًا طويلًا من الأرق بسبب حادث في طفولتها. عاشت “تشويه” وشقيقها الأصغر حياتهما معتمدين على بعضهما البعض. في ظل الظروف الخاطئة، أصبحت عروس الجنرال الشهير “شو ياو”. بعد معرفة الأحداث المشبوهة المحيطة بوفاة شقيق “شو ياو” الأكبر، يتكاتف الاثنان للتحقيق في القضية.', 'https://asia2tv.net/wp-content/uploads/2020/08/the-sleepless-princess.jpg', 0, '03/01/2021', 'Zheng-Ye-Cheng : في دور  Xue Yao \nHu-Yi-Xuan : في دور  Xu Chu Yue\nHuang-Can-Can : في دور  Su Nan Nan\nLin-Xin-Yi : في دور  Tao Yao\nYang-Lin : في دور  Xu Xing Chen\nDavid-Chou : في دور  Luo Ji', '2KfZhNij2YXZitix2Kkg2KfZhNiq2Yog2YTYpyDYqtmG2KfZhSBUaGUgU2xlZXBsZXNzIFByaW5jZXNz', 'يعرف ايضا بـ:', '35 حلقة'),
(41, 'إنجاز', 'الصين', 'عندما تستحضر إحدى ألعاب الواقع الافتراضي حلمًا واقعيًا ، يبدأ الشباب من جديد لرجل يعود إلى أيام دراسته في رحلة من الشفاء الذاتي.', 'https://asia2tv.net/wp-content/uploads/2020/08/Consummation-Thumb.jpg', 0, '03/01/2021', 'Zhao-Yi-Qin : في دور  Xia Shi\nLi-Hao-Fei : في دور  Ye Sang Yu\nDavid-Chou : في دور  Lin Shan He\nHuang-Xin-Yao : في دور  Cui Zhen Yan\nWang-Yi-Zhe : في دور  Zhong Fan Xin\nDong-Si-Yi : في دور  Xu Ran Ran', '2KXZhtis2KfYsiBDb25zdW1tYXRpb24=', 'She Guang De Mi Mi', '36'),
(42, 'لا شيء، فقط في الثلاثين', 'الصين', 'تدور أحداث دراما “شيء، فقط في الثلاثين” حول ثلاث نساء من خلفيات وشخصيات مختلفة. “جو جيا” ربة منزل وسيدة أعمال قوية الإرادة، كما أنها ساعدت زوجة ليصبح رئيساً تنفيذياً لإحدى لشركات وتتشاجر مع ربات المنزل الغنيات اللاتي يتنمرن على ابنها. و”وانج ماني”، امرأة متمردة وواثقة سواء في بيتها أو عملها، و”شونج شياو شين”، امرأة راضية بحياتها البسيطة ووظيفتها العادية وزوج يحب الأسماك.النساء الثلاث يواجهن العديد من الصراعات والتحديات، ويحاون التغلب عليها في عمر الثلاثين.', 'https://asia2tv.net/wp-content/uploads/2020/08/xxq00_4f-1.jpg', 0, '03/01/2021', 'Maggie-Jiang : في دور  Wang Man Ni \nTong-Yao : في دور  Gu Jia\nRachel-Mao : في دور  Zhong Xiao Qin\nEric-Yang : في دور  Chen Yu\nLi-Ze-Feng : في دور  Xu Huan Shan\nKevin-Yan : في دور  Zhong Xiao Yang', '2YTYpyDYtNmK2KHYjCDZgdmC2Lcg2YHZiiDYp9mE2KvZhNin2KvZitmGIE5vdGhpbmcgQnV0IFRoaXJ0eQ==', 'يعرف ايضا بـ:', '43'),
(43, 'رقصة السماء', 'الصين', 'تدور أحداث دراما “رقصة السماء” في حقبة سلالة تانغ المزدهرة في عصر يعيش فيه البشر والشياطين. وصول “لي شوان” هجين بشري وشيطاني، يكسر السلام الهش. خلال هذا الوقت، طور “لي شوان” ، جاسوس الشيطان “سو يوليان” و “لونج ويير” علاقات معقدة. بينما يصبح “لي شوان” في نهاية المطاف بطلاً للشعب، يواجه معضلة تتمثل في الاضطرار إلى تحديد مكان ولايته.', 'https://asia2tv.net/wp-content/uploads/2020/08/Egdx0_3f.jpg', 0, '03/01/2021', 'Xu-Kai : في دور  Li Xuan \nWu-Jia-Yi : في دور  Su You Lian\nZhou-Jun-Chao : في دور  Xiao Feng Ming\nHani-Kezi : في دور  Yun Shan\nJohnny-Zhang : في دور  Feng Chang Qing\nShi-Zi-Xun : في دور  Bian Ling Cheng', '2LHZgti12Kkg2KfZhNiz2YXYp9ihIERhbmNlIG9mIHRoZSBTa3k=', 'Dance of the Sky Empire', '28 حلقة'),
(44, 'نحن شباب في عمر الزهور', 'الصين', 'قصة عن بلوغ سن الرشد لمجموعة من الشباب نشأوا معًا. تدور أحداث القصة في عام 2007 ؛ التحق أربعة شباب من كلية شو دي ومستشفى أسرة الموظفين بالمدرسة الثانوية معًا ، مرحبينًا بسنتهم السادسة عشرة. يشكلون زمرتهم الخاصة المسماة “رقم 1992” ، ويشرعون في رحلة مليئة بالأحلام والنمو والدفء.', 'https://asia2tv.net/wp-content/uploads/2020/08/xw8J3_4c.jpg', 0, '03/01/2021', 'Marcus-Li : في دور  Tan Song\nTian-Xi-Wei : في دور  Huang Cheng Zi\nYou-Hao-Ran : في دور  He Jin Zhao\nLi-Ying-Ying : في دور  Zhu Jin Xiao\nLi-Ming-Yuan : في دور  Chen Zui\nLi-Xing : في دور  Tan Ou Yang', '2YbYrdmGINi02KjYp9ioINmB2Yog2LnZhdixINin2YTYstmH2YjYsSBMb3ZlbHkgVXM=', 'Ru ci ke ai de wo men', '16 حلقة'),
(45, 'إنطلق', 'الصين', 'تدور القصة حول ثلاثة شباب مضطربين يجدون العزاء في تجاربهم المشتركة ليصبحوا أفضل أسرة يمكن أن يكونوا لبعضهم البعض. نشأوا في أسر مختلة ، ثلاثة أفراد لا تربطهم صلة قرابة بالدم يعاملون بعضهم البعض مثل الأسرة لأنهم يتوقون إلى الحب الذي لا يمكنهم العثور عليه في المنزل. يكبر الأخ الأكبر لينغ شياو ، والأخ الثاني هي تسي تشيو ، والأخت الصغرى لي جيانجيان معًا ، ويعيشون فرحة الحياة والصراع بينما يدعمون المسارات المختارة لبعضهم البعض', 'https://asia2tv.net/wp-content/uploads/2020/08/go-aheadposter-1.jpg', 0, '03/01/2021', 'Seven-Tan : في دور  Li Jian Jian\nSong-Wei-Long : في دور  Ling Xiao\nSteven-Zhang : في دور  He Zi Qiu\nTu-Song-Yan : في دور  Li Haichao\nSun-Yi : في دور  Qi Ming yue\nHe-Rui-Xian : في دور  Tang Can', '2KXZhti32YTZgiBHbyBBaGVhZA==', 'In the Name of the Family', '40'),
(46, 'سيمفونية الرومانسية', 'الصين', 'تتحدث دراما “سيمفونية الرومانسية” عن “لي تشان يان” موسيقي موهوب امتلك كل شيء بالعالم، نال فرصة ليدرس الموسيقى على يد أفضل المعلمين بالخارج، لم يمانع في الاندماج مع العالم الخارجي لكن أشباح عالقة من ماضيه كانت تقيده بشدة، حيث يعاني من صدمة شديدة منذ الطفولة. و”شياو وو” أيضا عازفة بيانو بموهبة استثنائية لكن لديها سلوك غريب وشخصية أغرب لا تنال استحسان من يحيط بها. وقع “تشين يان” بحب “شياو وو”. وبدأ الاثنان يمضيان الوقت معا، كما بدأ “تشين يان” في ملاحقة أحلامه بوجود “شياو وو” بجانبه ليخططا معا لمستقبلهما.', 'https://asia2tv.net/wp-content/uploads/2020/08/Eg7bW_4f.jpg', 0, '03/01/2021', 'Jelly-Lin : في دور  Fang Xiao Wo \nSteven-Zhang : في دور  Li Zhen Yan\nNing-Huan-Yu : في دور  Tian Yi Song\nLi-Ning : في دور  Fei She Er / Fei Si Xing\nTino-Bao : في دور  Li Ya Zhe\nChen-Jing-Yang : في دور  Qin Fen', '2LPZitmF2YHZiNmG2YrYqSDYp9mE2LHZiNmF2KfZhtiz2YrYqSBTeW1waG9ueeKAmXMgUm9tYW5jZQ==', 'Cantabile Youth', '40 حلقة'),
(47, 'للطبيبة المتزوجة', 'الصين', 'تتحدث دراما “للطبيبة المتزوجة” عن “ليو تشينغ”، ابنة مسؤول قوي، التي تضطر إلى تحمل هوية الأميرة لأنها متزوجة من “يوين يونغ”، ملك “تشو”، الذي في الواقع شخصية دمية لا تملك أي سلطة.', 'https://asia2tv.net/wp-content/uploads/2020/08/qxQyz_4f.png', 0, '03/01/2021', 'Gong-Mi : في دور  Liu Jing / Jing Er \nYalkun-Merxat : في دور  Yuwen Yong\nZhang-Yong-Bo : في دور  Yuwen Zhao\nJoessi-Qiao : في دور  Yue Ya Er\nYoko-Wang : في دور  Tang Wan\nFei-Li-Qi : في دور  Chen Ke', '2YTZhNi32KjZitio2Kkg2KfZhNmF2KrYstmI2KzYqSBGb3IgTWFycmllZCBEb2N0cmVzcw==', 'The Wrong Royal Bride', '24 حلقة'),
(48, 'نعم! ياسيد الموضة', 'الصين', 'من أجل معرفة الحقيقة حول وفاة والدتهِ، ينضم وريث مجموعة “فنغ شانغ”. الشاب “شانغ بو ران” إلى مجلة الموضة وهو مُخفي لهويتهِ الحقيقية، وهناك يلتقي بالساذجة والمتفائلة “لو شياو كوي” ونتيجة لمزيج من الظروف الغريبة تنتهي بهذين المنافسين بالعيش معاً. ومع الأحداث والظروف والمواقف التي يمران بهما هذان الأثنان يقعان بالحب بالرغم من أختلاف الشاسع في الطباع.', 'https://asia2tv.net/wp-content/uploads/2020/08/Cj1dZfDUUAADNse-1.jpg', 0, '03/01/2021', 'Cheney-Chen : في دور  Shang Bo Ran\nOuyang-Nana : في دور  Li Xiao Kui\nYvonne-Yung : في دور  Shang Yun Xi\nWang-Duo : في دور  Wang Xing Ren\nMing-Ren : في دور  Gao Ming\nVivian-Wu : في دور  Leng Shan', '2YbYudmFISDZitin2LPZitivINin2YTZhdmI2LbYqSBZZXPvvIFNciBGYXNoaW9u', 'يعرف ايضا بـ:', '28'),
(49, 'عُد نجومك المحظوظة', 'الصين', 'المحرر الأنيق لو شينغ تشينغ له شخصية متغطرسة ولسان حاد. في عالم الموضة ، هو شخصية أسطورية ويشتهر بكونه محظوظًا. تونغ شياويو مصممة غير معروفة وغير محظوظة في كل ما تفعله. يتسبب حادث ما في تبادل حظوظهم وتتخذ حياتهم منعطفًا حادًا. بينما تتعرف تونغ شياو يو على لو شينغ تشينغ ، تتعلم تدريجيًا عن ماضيه المخفي وتكتشف رجلًا يتوق إلى العائلة على الرغم من واجهته المتغطرسة. تريد تونغ شياو يو مساعدته في العودة إلى مجدها السابق ، ولكن قد يكون من الصعب التعامل مع ميوله الأنانية.', 'https://asia2tv.net/wp-content/uploads/2020/08/EW7n0A1X0AABD9Z.jpg', 0, '03/01/2021', 'Shen-Yue : في دور  Tong Xiao You\nJerry-Yan : في دور  Lu Xing Cheng\nJackie-Li : في دور  Song Ru Ru\nMiles-Wei : في دور  Lu Yan Zhi\nShen-Yao : في دور  Wen Xi\nWilson-Wang : في دور  Mu Yang', '2LnZj9ivINmG2KzZiNmF2YMg2KfZhNmF2K3YuNmI2LjYqSBDb3VudCBZb3VyIEx1Y2t5IFN0YXJz', 'Exchange of Luck', '34 حلقة'),
(50, 'انت قدري', 'الصين', 'تروي الدراما قصة شخصين كانت حياتهما على شكل خطوط متوازية لم يكن من المفترض أن تتقاطع. بسبب اجتماع غير متوقع ، يصبحون مصير بعضهم البعض.', 'https://asia2tv.net/wp-content/uploads/2020/08/WBOl5f.jpg', 0, '03/01/2021', 'Xing-Zhao-Lin : في دور  Wang Xi Yi\nLiang-Jie : في دور  Chen Jia Xin\nJinna : في دور  Shi Anna\nLi-Jiu-Lin : في دور  Dylan / Di Lun\nChang-Long : في دور  An Son\nWang-Qian : في دور  Liu Si Qi', '2KfZhtiqINmC2KYsdmKIFlvdSBBcmUgTXkgRGVzdGlueQ==', 'Fated to Love You', '36 حلقة'),
(51, 'خذني إلى السماء', 'الصين', 'تدور القصة حول فتاة فقيرة تأتي بعقد غامض يجرها إلى عائلة ثرية لكنها غريبة. يو شياو يو هي فتاة بسيطة ولطيفة تكافح من أجل تغطية نفقاتها. عندما تصبح متلقية لعقد غامض ، تقفز يو شياو يو على فرصة الاختباء من المدينين. في بداية حياتها الجديدة ، تنضم إلى فريق الغوص حيث تلتقي بمجموعة من الشباب الذين يتشاركون نفس الأحلام. على طول الطريق ، تلتقي بالطفل الغني لينغ كونغ المتغطرس ويصعب التعامل معه ، ولكنه يمتلك حماسًا خالصًا للغوص. من خلال تفاعلاتهم ، يجدون تدريجيا الصداقة والحب.', 'https://asia2tv.net/wp-content/uploads/2020/07/swingtothesky7.jpg', 0, '03/01/2021', 'Hu-Bing-Qing : في دور  Yu Xiao Yu\nKris-Fan : في دور  Ling Kong\nCheng-Shuo-Nan : في دور  Ling Chen\nWu-Yu-Chen-Ning : في دور  Tang Shao\nRussel-Tang : في دور  Ling Zhi Xuan\nKele-Sun : في دور  Rong Zi', '2K7YsNmG2Yog2KXZhNmJINin2YTYs9mF2KfYoSBTd2luZyB0byB0aGUgU2t5', 'Swin to Sky', '24 حلقة'),
(52, 'كفاح العشرينات', 'الصين', 'يتم سرد قصة عن مخاوف الشباب عند دخولهم سن الرشد من منظور أربع فتيات حول الخريجين من الكلية. كونها شخصًا بلا قوة ولا مظهر ولا مال ، لطالما حسدت جيانغ شياو قوه زملائها الثلاثة في الغرفة. دوان جيا باو الذي تأتي من عائلة ثرية لديه رغبات بسيطة. إنها خالية من الهموم وتهتم فقط بمطاردة المشاهير وتناول طعام جيد. قد تحتقر لوه يان ميل والدتها لتصبح متعجرفة للغاية ، ولكن على الأقل يمكنها أن تطمئن إلى أن مستقبلها في أيد أمينة. ليانغ شوانج جميلة وخاطبة. على الرغم من أنها مجرد خريجة جامعية ، فقد أثبتت نفسها بالفعل أكثر من قدرتها على التكيف مع المجتمع. ومع ذلك ، فهي لا تعرف أن كل شخص سيكون له صليبه الخاص لتحمله. تتذوق دوانج جياباو طعم الحب الأول فقط لتدرك أنها وصديقتها قد وقعتا في حب الرجل نفسه. أثناء محاولتها فهم والدتها ، تتعرف لوه يان على سر والدتها الذي ظل طويلًا. في هذه الأثناء ، لا تزال ليانغ شوانغ بحاجة إلى تعلم كيفية عدم إيذاء الأشخاص الذين يهتمون بها. في عام واحد ، أصبحت السيدات الأربع أقرب تدريجيًا.', 'https://asia2tv.net/wp-content/uploads/2020/07/Ecxcj55UwAA1Sr8.jpg', 0, '03/01/2021', 'Gabrielle-Guan : في دور  Liang Shuang\nBu-Guan-Jin : في دور  Jiang Xiao Guo\nTeresa-Li : في دور  Luo Yan\nDong-Si-Yi : في دور  Duan Jia Bao\nKingscar-Jin : في دور  Zhou Xun\nNiu-Jun-Feng : في دور  Zhao You Xiu', '2YPZgdin2K0g2KfZhNi52LTYsdmK2YbYp9iqIFR3ZW50eSBZb3VyIExpZmUgT24=', 'Twenty Not Confused', '40 حلقة'),
(53, 'رحلة نيزا البطولية', 'الصين', 'قصة تحكي عن اتحاد نيزا، ابن الملك السماوي لي جينغ الحامل للمعبد (وهو برج يمكنه التقاط أي روح أو شيطان أو إله داخل جدرانه)، وشياو لونج نو أميرة البحار الشرقية للعمل من أجل قتل الشياطين وهزيمة قوى الشر.', 'https://asia2tv.net/wp-content/uploads/2020/07/Nezha.jpeg', 0, '03/01/2021', 'قصة تحكي عن اتحاد نيزا، ابن الملك السماوي لي جينغ الحامل للمعبد (وهو برج يمكنه التقاط أي روح أو شيطان أو إله داخل جدرانه)، وشياو لونج نو أميرة البحار الشرقية للعمل من أجل قتل الشياطين وهزيمة قوى الشر.', 'SGVyb2ljIEpvdXJuZXkgb2YgTmV6aGEgLyDYsdit2YTYqSDZhtmK2LLYpyDYp9mE2KjYt9mI2YTZitip', '哪咤降妖记', '50'),
(54, 'نشيد المجد', 'الصين', 'في مواجهة واحدة من أقوى العشائر الفاسدة في البلاد ، يجب على “يي كانغ” و “لي جي” استخدام كل أونصة من ذكائهم وقوتهم لهزيمة خصومهم الأقوياء الذين يطالبون بالسلطة.', 'https://asia2tv.net/wp-content/uploads/2020/07/202007011593610374.jpg', 0, '03/01/2021', 'Li-Qin : في دور  Shen Li Ge\nQin-Hao : في دور  Liu Yi Kang\nJason-Koo : في دور  Liu Yi Xuan\nLong-Zheng-Xuan : في دور  Wang Zi Jin\nLu-Zhan-Xiang : في دور  Kong Cheng\nEddie-Cheung : في دور  Shen Ting Zhang', '2YbYtNmK2K8g2KfZhNmF2KzYryBUaGUgU29uZyBvZiBHbG9yeQ==', 'Jing Xiu Chang Ge', '53 حلقة'),
(55, 'حب كرة السلة', 'الصين', 'تصمم طالبة جامعة تشينغ مينغ سو نوان شيا على استكمال رغبة والدها الأخيرة في إعادة تجميع فريق كرة السلة وقيادتهم إلى الفوز على منافسهم شين هوا، في أحد الأيام ، اكتشفت نوان شيا بطريق الخطأ أن المدرسة لديها “جون يي” ذو المهارات العالية ، حاولت فعل كل ما في وسعها لتجنيده من خلال التشبث به على مدار الساعة إلى أن تراجع أخيرًا. نجحت نوان شيا بجمع فريق من غريب الأطوار الوسيمين، خلال التدريب يوم بعد يوم ينجذب جون يي إلى شخصية نوان شيا المبهجة ويبدأ في ملاحقتها بعد أن تخلى عن الرياضة ، استعاد جون يي الشغف وأصبح مصممًا على إظهار مهارته لنوان شيا. ومع ذلك ، يدرك أن الاضطرابات الداخلية لاتزال تلاحقه. ورغم ذالك يتحد نوان شيا و جون يي وزملاؤهم معًا للوصول إلى حلمهم.', 'https://asia2tv.net/wp-content/uploads/2020/07/xiaye6.jpg', 0, '03/01/2021', 'Aaron-Deng : في دور  Jun Ye / Ye Shen\nWang-Zi-Wei : في دور  Su Nuan Xia\nJiang-Shen : في دور  Xiao Tu Tu\nYu-Kai-Ning : في دور  Xia Ze\nHe-Qian-Ying : في دور  Qing Zi\nXi-Yu-Li : في دور  Xia Qing Xue', '2K3YqCDZg9ix2Kkg2KfZhNiz2YTYqSBCYXNrZXQgTG92ZWJhbGw=', 'Love of Summer Night', '24 حلقة'),
(56, 'الحب الموازي', 'الصين', 'تدور القصة حول مُنظِمة المناسبات الناجحة ” لين مياو ” والتي يعود بها الزمن لعام 2010، فتتلقى مهمة عليها إنجازها كي تعود لعام 2020، تتمثل هذه المهمة في مساعدتها لـ ” جياو يانج ” كي يصبح رئيس شركة والده خلال 3 أشهر، ولو فشلت، ستختفي للأبد.', 'https://asia2tv.net/wp-content/uploads/2020/07/RRJOV_3f.png', 0, '03/01/2021', 'Li-Hong-Yi : في دور  Jiao Yang\nKira-Shi : في دور  Lin Miao / Lin Wei Jun\nYang-Ze : في دور  Su Cheng Yun\nWang-Yu : في دور  Zhao Yan\nChang-Hua-Sen : في دور  Ding Ding\nLuo-Zheng : في دور  Sui Yi', '2KfZhNit2Kgg2KfZhNmF2YjYp9iy2YogUGFyYWxsZWwgTG92ZQ==', 'Time countdown to meet you', '24 حلقة'),
(57, 'السيد الصادق', 'الصين', 'تفقد “شو يي رين” علاقتها ومهنتها في ليلة واحدة. صديقتها المقربة “شيا دي” توصيها لشركة معمارية كمساعدة للمدير التنفيذي، على أية حال ، خلال المقابلة ، تكتشف أن ذلك الرئيس التنفيذي (فانغ تشي يو) هو الشخص الذي كشف بأن خليلها يخونها في العلن. على الرغم من أنها لا تعرف لماذا ، “شو يي رين” تحصل في نهاية المطاف على الوظيفة ، و لكن يجب أن تتعامل مع مهمة غريبة للكذب من أجل رئيسها.. لكن “فانغ تشي يو” يميل لكشف أكاذيبها في العلن دائما ما يضعها في مواقف محرجة.', 'https://asia2tv.net/wp-content/uploads/2020/06/unnamed-11.jpg', 0, '03/01/2021', 'Liang-Jie : في دور  Xu Yi Ren\nXin-Yun-Lai : في دور  Fang Zhi You\nLiu-Hai-Kuan : في دور  Li Zhe\nLuo-Qiu-Yun : في دور  He Yu Wen\nWu-Ji-Feng : في دور  Gu Bo\nMinyee-Chen : في دور  Xia Di', '2KfZhNiz2YrYryDYp9mE2LXYp9iv2YIgTXIgSG9uZXN0eQ==', 'Don’t Lie To Your Lover', '31 حلقة'),
(58, 'سيطرة الحب', 'الصين', 'تدور الدراما حول الرومانسية بين رئيس تنفيذي صعب الإرضاء والمساعدة الخاصة المؤقتة. “ني شينغ تشين” هي المساعدة الجديدة لـ “يان جينغ تشو” . على الرغم من لقائها لأول مرة ، كانت تعرف بالفعل العادات اليومية الصعبة لرئيسها إنه رئيس تنفيذي متغطرس بمعدل ذكاء مرتفع ، ويعاني من اضطراب الوسواس القهري المعتدل ، وحازم في العمل ويسعى إلى الكمال في الحياة ، ولكنه أيضًا رجل مثالي في قلوب العديد من الفتيات. في حين أن ني شينغ تشن السكرتيرة المثالية في العمل ، لطيفة وجميلة وقادرة ومستقلة ولديها دائمًا موقف إيجابي ومتفائل بشأن الحياة. تتمكن ني شينغ تشين ، المشهور بكونه رئيسًا طيب القلب ، من الإمساك به والتعامل معه بمفردها مع مرور الوقت ، بدأ يان جينغ تشو وني شينغ تشين في الوقوع في الحب حتى واجهوا مشاكل مع بعضهم البعض. ما هي القصة النهائية التالية لاثنين من الغرباء ولكنهما رأيا بعضهما البعض لسنوات؟', 'https://asia2tv.net/wp-content/uploads/2020/06/Well-Dominated-Love-Poster.jpeg', 0, '03/01/2021', 'Lulu-Xuan : في دور  Nie Xing Chen\nEden-Zhao : في دور  Yan Jing Zhi\nJin-Wen-Xin : في دور  Tong Xin\nWang-Qian : في دور  Zhen Nian\nLiu-You-Chang : في دور  Han Zi Yu\nLiu-Yin-Jun : في دور  Zhao Yuan Fang/span>', '2LPZiti32LHYqSDYp9mE2K3YqCBXZWxsIERvbWluYXRlZCBMb3Zl', 'What If You’re My Boss?', '24 حلقة'),
(59, 'انت قدري', 'الصين', 'تروي الدراما قصة شخصين كانت حياتهما على شكل خطوط متوازية لم يكن من المفترض أن تتقاطع. بسبب اجتماع غير متوقع ، يصبحون مصير بعضهم البعض.', 'https://asia2tv.net/wp-content/uploads/2020/06/we65k_4f.jpg', 0, '03/01/2021', 'Xing-Zhao-Lin : في دور  Wang Xi Yi\nLiang-Jie : في دور  Chen Jia Xin\nJinna : في دور  Shi Anna\nLi-Jiu-Lin : في دور  Dylan / Di Lun\nChang-Long : في دور  An Son\nWang-Qian : في دور  Liu Si Qi', '2KfZhtiqINmC2KYsdmKIFlvdSBBcmUgTXkgRGVzdGlueQ==', 'Fated to Love You', '36 حلقة'),
(60, 'فتاتي', 'الصين', 'https://youtube.com/watch?v=sPO6_jVrOkw%3Frel%3D0', 'https://asia2tv.net/wp-content/uploads/2020/06/download.jpg', 0, '03/01/2021', 'https://youtube.com/watch?v=sPO6_jVrOkw%3Frel%3D0', '2YHYqtin2KrZiiBNeSBHaXJs', '99 points girlfriend , 99 Fen Nu Peng You', '24 حلقة'),
(61, 'فتاة السيوف الجميلة', 'الصين', 'تتحدث دراما “فتاة السيوف الجميلة” عن امرأة شابة سعيدة لا تنسى أن تضحك، وتلاحق بعد الحب الحقيقي حتى أثناء الوقوع في مثلث الحب. من خلال رحلتها، تنمو لتصبح شخصًا محبوبًا وتحبط مخططًا شريرًا في العالم. بينما يتوق قلبها للحب، “شينغ يو” لم تلتقي برجل واحد بل رجلين. أحداهم “غونغ يوان شيو”، زوجها الأحمق الذي تزوجها على عجل من أجل مظهرها. قد يكون مشوشًا في معظم الأشياء لكنه محبوب للغاية ويحمي “شينغ يو”. و والآخرى هو “ايد يوشو” ، صديق طفولتها وسيد طائفة. بعد أن أحب “شينغ يو” لسنوات عديدة، هو على استعداد للتخلي عن كل شيء من أجلها، حتى حياته. في مواجهة نوعين حقيقيين وفريدين ومختلفين من الحب، البريئة “شينغ” لا تستطيع أن تفهم مشاعرها وتجد صعوبة في الاختيار بين رجلين مثاليين. قد يكون “غونغ يوان شيو” و”ايد يوشو” منافسين ، لكنهما مثل الإخوة. بسبب قربهم، انفتحوا على فكرة أن الثلاثة يمكن أن ينسجموا.', 'https://asia2tv.net/wp-content/uploads/2020/06/lovely-swords-girl.jpg', 0, '03/01/2021', 'Yang-Shi-Ze : في دور  Gong Yuan xiu \nJiang-Zhen-Yu : في دور  Yu Sheng You\nHe-Yi-Qian : في دور  Aide Yushu\nXu-Kai-Xin : في دور  Gong Yuan Han\nSun-Zi-Hang : في دور  Yu Sheng Bai\nLiu-Tian-Chi : في دور  E Niang', '2YHYqtin2Kkg2KfZhNiz2YrZiNmBINin2YTYrNmF2YrZhNipIExvdmVseSBTd29yZHMgR2lybA==', 'Lian Lian Jiang Hu', '24 حلقة');
INSERT INTO `serie_detail` (`id_serie`, `title_serie`, `country_serie`, `desc_serie`, `img_serie`, `views_serie`, `date_serie`, `namedrama__serie`, `id_serie_detail`, `autrename`, `allep`) VALUES
(62, 'السيد الثعلب والآنسة الزهرة', 'الصين', 'الدراما تروي قصة حب لـ (المرأة الخارقة) و (مستكشف الأحجار الكريمة) جاو تشين هي، شاب، الذي يكسب رزقه من خلال استكشاف الأحجار الكريمة الراقية وفي يومًا ما، سقط من المنحدر ويجد مكانا تحته حيث توجد قبيلة بدائية. بعد أن أنقذت قائدة القبيلة الأنثى، (شينج يو) (جاو تشين هي)، تريده أن يكون رجلها من أجل الحصول على الأحجار الكريمة النادرة للقبيلة، جاو تشين هي، يتظاهر بالزواج من شينج يو. بعد الحصول على الأحجار الكريمة، يهرب عائدا إلى المدينة ، و (تشينج يو) تسعى خلفه في الغالب للعثور عليه وعلى أحجارها، مما يؤدي إلى سلسلة من القصص.', 'https://asia2tv.net/wp-content/uploads/2020/06/mr-fox-and-miss-rose.jpg', 0, '03/01/2021', 'Zhang-Ya-Qin : في دور Xing Yue\nRen-You-Lun : في دور Gao Zhen He\nChen-Xi-Jun : في دور Yi Tian\nJiang-Peng : في دور Qin Shu\nYu-Hao-Yang : في دور Zuo Xiao Jia\nZhang-Han : في دور Yun He', '2KfZhNiz2YrYryDYp9mE2KvYudmE2Kgg2YjYp9mE2KLZhtiz2Kkg2KfZhNiy2YfYsdipIE1yLiBGb3ggYW5kIE1pc3MgUm9zZQ==', 'Qiu zhang de nan ren', '30 حلقة'),
(63, 'مصمم الحب', 'الصين', 'الدراما تروي قصة حب بين مصممة أزياء ورجل يعمل في صناعة التجارة الإلكترونية.\nالتقت مصممة الأزياء “تشو فانغ”(ديلرابا ديلمورات) بـ “سونغ لين”(هوانغ جينغ يو) بسبب دعوى قضائية. لقد كانا غير متفاهمين منذ البداية ولكن كان عليهما التعاون المتبادل في حياتهما وعملهما. كان من الضروري أن يؤدي وجود شخصين متماسكين معًا إلى صراعات ولكن في عملية التنافس مع بعضهما البعض ،تقع تشو فانغ و سونغ لين في الحب تدريجيًا. نظرًا لأنهم يسعون إلى أن يكونوا إصدارات أفضل لأنفسهم ، تعمل تشو فانغ بجد لإنشاء علامة تجارية متطورة بينما يدفع سونغ لين الذي يعطي الأولوية للكفاءة قبل كل شيء إلى تحقيق تقدم في حياته المهنية.', 'https://asia2tv.net/wp-content/uploads/2020/06/1gAAKf.jpg', 0, '03/01/2021', 'Dilraba-Dilmurat : في دور Zhou Fang\nJohnny-Huang : في دور Song Lin\nViann-Zhang : في دور Qin Qing\nYi-Da-Qian : في دور Zuo Yu Lin\nHu-Bing : في دور Su Yu Shan\nWang-Quan-You : في دور Zhou You Nian', '2YXYtdmF2YUg2KfZhNit2KggTG92ZSBEZXNpZ25lcg==', 'A Love For Haute Couture', '45 حلقة'),
(64, 'حبي ينورني', 'الصين', 'تتحدث دراما “حبي ينورني” عن “نوان نوان” نجمة البوب الشابة، البالغة من العمر 22 عامًا، التي أجبرت على إعادة ترتيب حياتها بعد أن تم إلغاء فرقة الفتيات التي كانت عضوًة فيها في ليلة ظهورها. في البداية، تكافح في بحثها عن وظيفة، ‘لى أن إلتقت مع شاب يدعى “هان تشي”. يبدأ “هان تشي” أيضًا بداية حياته المهنية ببطء، ويعمل ككاتب في متجر ملابس. ومع ذلك، سرعان ما اتضح أنه رئيسًا كبيرًا للمبيعات ، وسرعان ما أصبح كاتب النجوم في المتجر، وفي النهاية حصل على ترقية إلى المكتب الرئيسي للشركة. تلهم قصة نجاح “هان هان” في تجارة التجزئة “نوان نوان”، الذي كان دائمًا حريصًا على الموضة.', 'https://asia2tv.net/wp-content/uploads/2020/06/images.jpg', 0, '03/01/2021', 'Eleanor-Lee : في دور Liu Nuan Nuan\nLeon-Leong : في دور Han Che\nTim-Pei : في دور Fang Han Chen\nXiong-Yu-Ting : في دور Han Xue\nLi-Ming-Jun : في دور Gu Li\nTracey-Zang : في دور Guo Guo\nJovi-Xu : في دور Gao Ming', '2K3YqNmKINmK2YbZiNix2YbZiiBNeSBMb3ZlIEVubGlnaHRlbiBNZQ==', 'Please advise / warmly', '24 حلقة'),
(65, 'سيدة فريدة من منوعها', 'الصين', 'تتحدث دراما “سيدة فريدة من منوعها” عن “لين لوه جينغ” التي يتم جذبها بشكل مفاجئ إلى عالم الألعاب، حيث تصبح ابنة رئيس الوزراء في اللعبة، وتلتقي بكل أنواع الرجال الجميلين مع شخصيات مختلفة. من بينهم إله السيف، وحارس شخصي إمبراطوري، ورجل غني لعوب وأمير متكبر. يخبرها النظام أنها لا تستطيع العودة إلى العالم الحقيقي إلا بعد أن تجد حبها الحقيقي. بينما يبدو أن هناك وفرة من الرجال الطيبين حول “لوه جينغ”، هناك رجل واحد لا تطيقه على الإطلاق، وهو أمير مملكة البربري “تشونغ وو مي”. ولكن من بين جميع الرجال، انتهى بها الأمر في زواج مدبر مع “وو مى”.', 'https://asia2tv.net/wp-content/uploads/2020/06/8b343329c9da176f03830d692ddcc178.jpg', 0, '03/01/2021', 'Simon-Gong : في دور Zhong Wu Mei\nJade-Cheng : في دور Lin Luo Jing\nAlen-Fang : في دور Liu Xiu Wen\nYu-Kai-Ning : في دور Jiang Xuan Yu\nQiu-Hao-Xuan : في دور Jin Chen\nYi-Sha : في دور Xi Que\nLi-Hao : في دور Hua Ying Chi', '2LPZitiv2Kkg2YHYsdmK2KYqSDZhdmGINmF2YbZiNi52YfYpyBVbmlxdWUgTGFkeQ==', 'Lascivious Lady', '12 حلقة'),
(66, 'زهرة جميلة ولدت من جديد', 'الصين', 'تتحدث دراما “زهرة جميلة ولدت من جديد” عن “لين هيبينغ” الذي يعمل كأمين معرض فني مشهور. يلتقى بـ”شياو مان” ويتفاجئ بأنها تشبه المرأة التي أحبها منذ سنوات. “نان شينغ” والتي كانت ابنة زوجة أبيه، لكن هذا الحب بينهما لم يجلب سوى المآسي لهما وانتها بانتحار “نان شينغ”. اكتشف بعدها “لين هيبينغ” بأن “شياو مان” و “نان شينغ” لا تتشابهان في الشكل فحسب لكن في أشياء كثيرة وهناك ترابط غام بينهما.', 'https://asia2tv.net/wp-content/uploads/2020/06/download-1.jpg', 0, '03/01/2021', 'Jelly-Lin : في دور Qiao Man | Nan Sheng\nSong-Wei-Long : في دور Lin He Ping\nPeter-Ho : في دور Han Sen\nDavid-Wang : في دور An Kai Lun\nLee-Hsin-Ai : في دور Xu Ah Li\nXie-Bin-Bin : في دور Luo Chen', '2LLZh9ix2Kkg2KzZhdmK2YTYqSDZiNmE2KYqiDZhdmGINis2K/ZitivIEJlYXV0aWZ1bCBSZWJvcm4gRmxvd2Vy', 'Bi An Hua', '50 حلقة'),
(67, 'الأميرة المزيفة', 'الصين', 'ماذا لو كانت تحب المال، ألا يحب كل اللصوص الجبلية المال؟ للحصول على صندوق مليء بالذهب، تقدم اللصوص الجبلية نفسها إلى الأمير مما يمثل البداية لرومانسية جميلة. “تشينغ لي” كانت ذات يوم لصة حرة ولا ترحم. ومع ذلك، أصبحت العروس المزيفة في الزواج من ولي العهد “لي تشي”. عند الدخول إلى حدود القصر، تَجد “تشينغ لي” صعوبة في التكيف بعد تعرضها للإهانة بشكل متكرر. على الرغم من وضعها، تتعلم كيف تتكيف مثل القطط الوحشية التي تظهر هيئتها الحقيقية. “لي تشي” الذي يتبع كل خطوة يقظة يجد نفسه ينجذب تدريجياً من الحيوية “تشانغ لي”. كل شخص يرتدي قناعاً لإخفاء دوافعه الخاصة، يجد الشخصان الراحة لبعضهما.', 'https://asia2tv.net/wp-content/uploads/2020/06/Fake-Princess-Poster.jpg', 0, '03/01/2021', 'Zhao-Yi-Qin : في دور Li Che\nEleanor-Lee : في دور Chang Le / Liu Yu Yao\nGarvey-Jin : في دور Li Heng\nChen-Si-Yu : في دور Gong Sun Mo\nSun-Xue-Ning : في دور Zhu Yan\nWang-Yi-Tian : في دور Nong Ying', '2KfZhNij2YXZitix2Kkg2KfZhNmF2LLZitmB2KkgRmFrZSBwcmluY2Vzcw==', 'Replacement Princess', '27 حلقة'),
(68, 'خداع رئيسي', 'الصين', 'تخرجت خريجة جديدة في مدينة كبيرة لتحقيق أحلامها. تتابع القصة حياتها كنجمة على الإنترنت، وبينما تصطدم بشيء، تلتقي برئيس شركة، وبالتالي تبدأ علاقة رومانسية لطيفة بين الاثنين. جيانغ تشو تشو هي صاحبة شركة ملابس صغيرة ونجمة إنترنت. في أحد الأيام، تضررت الملابس التي صممت عليها بسبب الملابس الداخلية التي ارتدتها مما دفعها إلى إعطاء مراجعة سيئة حول شركة الملابس الداخلية عبر الإنترنت. لوه تيان يي، هو الرئيس التنفيذي لشركة الملابس الداخلية الذي يحيط علماً بهذه المراجعة التي جاءت في مرحلة حرجة في العمل. يؤدي سوء الفهم إلى اعتقاد الناس بأن جيانغ تشو تشو هي حبيبة لوه تيان يي. تأتي تشو تشو لإدراك الضغوط الشديدة تحت واجهة شهرة الإنترنت. تخضع علاقتها الرومانسية مع لوه تيان يي للعديد من المحاكمات بسبب التفاوت في خلفياتهم. ينشأ اختبار أكبر في المرحلة الدولية لأزياء الملابس الداخلية. على الرغم من أن النجاح غير مؤكد، إلا أن تشو تشو وأصدقائها على استعداد لتقديم كل ما لديهم.', 'https://asia2tv.net/wp-content/uploads/2020/06/B2rrAf.jpg', 0, '03/01/2021', 'Charlene-Chen : في دور Jiang Chu chu\nLu-Yong-Zhuo : في دور Luo Tian Yi\nPu-Tao : في دور Xiao Yu\nJiang-Qin-Yun : في دور Angela\nHunt-Liu : في دور Yue Cheng\nJustin : في دور Nan nan', '2K7Yr9in2Lkg2LHYptmK2LPZiiBDaGVhdCBNeSBCb3Nz', 'Macaron Girl / Ma Ka Long Shao Nu', '24 حلقة'),
(69, 'حب القدر', 'الصين', 'تحدث دراما “حب القدر” عن حارس النجوم والمسئول عن توازن الكون عندما يفقد مفتاح قوته، فيضطر للتجول في عالم البشر في محاولة بائسة لإيجاده، يحب أنثي قوية يلتقط قلبه في النهاية في محاولة لإبقاءها معه تحاول تشي يو إعادة كتابة مصيرها لتقضي علي نفسها في سن الثلاثين في كل حياتها اللاحقة وكعقاب علي أفعاله تم سجنه 3000 عام في النجوم بعد ان يصبح حرًا، يعود للأرض لإصلاح المشكلات هل سيكون قادرًا علي إصلاح آلاف السنوات من المشكلات ؟!', 'https://asia2tv.net/wp-content/uploads/2020/06/b6cf55fc9a209595b4ff0485924bf491.jpg', 0, '03/01/2021', 'Lulu-Xu : في دور Wen Su Xi\nZhang-Ming-En : في دور Chi Yu\nMing-Ren : في دور Tang Mao\nWu-Xin : في دور Cai Shu Meng\nSylvia-Hsieh : في دور Duo La\nXu-Yang : في دور Hua Shao', '2K3YqCDYp9mE2YLYr9ixIERlc3RpbnnigJlzIExvdmU=', 'The Life Planner', '36 حلقة'),
(70, 'سيدتي العزيزة', 'الصين', 'قررت لينغ بعد طلاقها من زوجها الاحتفال بكونها أصبحت عزباء، ولكن في طريقها إلى حفلة، اصطدمت سيارتها بسيارة فاخرة على جانب الطريق، مالك السيارة هو تشينغ لي، شاب يبدو أنه متخرج من الجامعة، طلب منها مبلغ كبير من المال كتعويض، وما زاد من سوء الأمر هو اكتشافها أنه رئيسها في شركتها الجديدة.', 'https://asia2tv.net/wp-content/uploads/2020/05/download-2.jpg', 0, '03/01/2021', 'Jiang-Meng-Jie : في دور Ling Xun Xun\nLiu-Te : في دور Cheng Li\nViola-Mi : في دور Zhou Quan\nSky-Li : في دور Hui Yi Wang\nGuansen-Zhang : في دور Support Role\nYilia-Yu : في دور Support Role', '2LPZitiv2KrZiiDYp9mE2LnYstmK2LLYqSBNeSBEZWFyIExhZHk=', 'Ni Cheng Gong Yin Qi Wo De Zhu Yi Le', '16 حلقة'),
(71, 'الأفضل منك في ذاكرتي', 'الصين', 'تحكي الدراما قصة صديقان منذ الطفولة، شابة من عائلة محطمة و رامي سهام متغطرس، كما أنهم يحبان بعضهما سراً. عندما كانا في الجامعة خسرت “لين تشي تشي” نفقات معيشتها لمدة شهر بسبب رهان على مباراة الأذرع مع “شو فانغ”. بسبب علاقتهما كـ مدين و مُدان يُصبح الإثنان مقربان من بعضهما. يمكن لـ “لين تشي تشي” أن تتصرف دون تحفظات حول “شو فانغ” لإنهم أصدقاء طفولة ما الذي سيحدث مع هذان الصديقان المقربان؟!', 'https://asia2tv.net/wp-content/uploads/2020/05/tb1.jpg', 0, '03/01/2021', 'Gala-Zhang : في دور Xu Fang\nIreine-Song : في دور Lin Xi Chi\nQu-Jing-Jing : في دور He Li Yang\nLeslie-Ma : في دور Nie Yue\nLi-Chung-Lin : في دور Ye Shao Wen\nGuo-Xin-Yu : في دور Jiang Zheng Xu', '2KfZhNij2YHYttmEINmF2YbZgyDZgdmKINiw2KfZg9ix2KrZiiBUaGUgQmVzdCBPZiBZb3UgSW4gTXkgTWluZA==', 'The Best of You All Over the World', '24 حلقة'),
(72, 'رفيقي في الغرفة هو المحقق', 'الصين', 'تتحدث دراما “رفيقي في الغرفة هو المحقق” عن قصة في منتصف العشرينات من القرن الماضي كان ضابط شرطة شاب حاذق يُدعى “تشياو تشو شنغ”. يُلاحق قاتل وحشي ومخادع أيضًا، ويدرك أن قوة الشرطة ستحتاج لمساعدة إضافية في هذه القضية الصعبة لذلك قرر تشكيل فريق من المحققين. فيتواصل مع شاب عاد مؤخرًا من الدراسة في بريطانيا العظمى “يو غونغ زي”. لأنه يتمتع بقدرات رائعة على الاستنتاج وعقل لامع. لاستكمال الفريق، يستعين بمساعدة “باي يو نينغ”، وهي مراسلة شابة تعمل في صحيفة يومية. إنها شابة حرة التفكير ومستقلة ولديها إحساس قوي بالعدالة، وتتعهد بالمساعدة في القبض على القاتل. هل يستطيع الثلاثي الوصول إلى قاع قضية القتل في الوقت المناسب لاستعادة النظام؟ وتقديم المجرم الخسيس إلى العدالة؟', 'https://asia2tv.net/wp-content/uploads/2020/05/007F8dwkly1gd578vrpjhj3191282kjn.jpg', 0, '03/01/2021', 'Hu-Yi-Tian : في دور Lu Yao\nLeon-Zhang : في دور Qiao Chu Sheng\nShane-Yan : في دور Bai You Ning\nVera-Lu : في دور Meng Xiao Yun\nZhang-Xiang : في دور Lin Xiao Bai\nJennifer-Ding: في دور Wan Ying', '2LHZgdmK2YLZiiDZgdmKINin2YTYutix2YHYqSDZh9mIINin2YTZhdit2YLZgiBNeSBSb29tbWF0ZSBpcyBhIERldGVjdGl2ZQ==', 'The Republic of China', '36 حلقة'),
(73, 'الحب الشديد', 'الصين', 'تروي دراما “الحب الشديد” قصة الحب بين طبيب عبقري وممثلة وهما شخصان يرفضان ترتيب زواج والديهما، لكنهما يدركان أن الحب مقدّر. الممثلة سو جين باي لديها جمال يمكن أن يتحدى السماء. مع تزايد شعبيتها، اعتادت أن تكون مركز الاهتمام. ومع ذلك، فإن الجانب المظلم للشهرة يعني أنها نقطة جذب للجدل. قد تكون هي الأفضل في المغازلة لكنها لا تحصل على مزيد من المعلومات وهي عازبة منذ الولادة. تشو شي يون هو طبيب عبقري المظهر والمال والذكاء. إنه منشد الكمال الذي يحب أن يكون مسيطراً ولكنه يهتم كثيراً بأشياء كثيرة لأنه قد يكون غير مبالٍ تماماً. تتجمع النساء حوله بأعداد كبيرة ولا يضايق. بدلاً من الرئيس التنفيذي المعتاد الذي يقع على عاتق المرأة، فإن الممثلة هي التي تأخذ زمام المبادرة في الحب.', 'https://asia2tv.net/wp-content/uploads/2020/05/300px-Intense_Love.jpeg', 0, '03/01/2021', 'Zhang-Yu-Xi : في دور Su Jin Bei\nRyan-Ding : في دور Dr. Zhou Shi Yun\nJulio-Wan-Yan : في دور Dr. Xiao Yuan Song\nWu-Yang : في دور Wu Di\nLin-Xin-Yi : في دور Zhou Su Ying\nZhang-Yao : في دور Gao Zi Tong', '2KfZhNit2Kgg2KfZhNi02KZitivIEludGVuc2UgTG92ZQ==', 'Yun Se Guo Nong', '24 حلقة'),
(74, 'القبضة اللطيفة', 'الصين', 'تبدو فنغ بياوبياو مهذبة بما يكفي لبقية العالم – فنية ، ومقروءة جيدًا ، ومائلة موسيقيًا ، وتحمل دائمًا كتابًا معها. ولكن بين القبور مخفية ، فإن جميع لوحاتها وخطها في الواقع من قبل جدها.', 'https://asia2tv.net/wp-content/uploads/2020/05/sweet-tai-chi.jpg', 0, '03/01/2021', 'سرعان ما تتعلم أن وي تشو لديه سر خاص به – هو وريث نفس عشيرة تاي تشي التي خانها جدها ذات مرة. هل سيكتشف سرها أولاً قبل أن تكتشف كيفية مسح اسم جدها؟', 'U3dlZXQgVGFpIENoaSDYp9mE2YLYqNi22Kkg2KfZhNmE2LfZitmB2Kk=', 'يعرف ايضا بـ:', '24'),
(75, ' معادلات الحب', 'الصين', 'تشو شياو رائعتين وشامبانيا ، هي المفضلة لدى أقرانها. طالبة أدب جامعي مع ميل للروايات البوليسية ، تقضي أيامها الضائعة في صفحات ألغازها المفضلة ، وتتوق دائمًا لمعرفة ما سيحدث بعد ذلك. مع مثل هذا الحب المتفاني لمثل هذه القصص ، فإنه ليس من المستغرب عندما تجد نفسها تقع في واحدة من تخصصات علوم الطب الشرعي في الجامعة.', 'https://asia2tv.net/wp-content/uploads/2020/05/the-love-equations.jpg', 0, '03/01/2021', 'في نهاية المطاف ، سيذهبون بطرقهم المنفصلة ، يبدو أن قصة حبهم القصيرة والسعيدة قد انتهت. أو هو؟ عندما يجمع القدر بين الاثنين ، يجدون أنفسهم يتساءلون عما إذا كان من الممكن تحقيق أحلامهم ، في حياتهم المهنية وفي الحب', 'VGhlIExvdmUgRXF1YXRpb25zINmF2LnYp9iv2YTYp9iqINin2YTYrdio', 'يعرف ايضا بـ:', '28'),
(76, 'أحبك كما أنت', 'الصين', '“تشن يوان يوان” هي فتاة ممتلئة وقعت في حب طالب من مدرستها الثانوية يُدعى “روان دونج شين” لكنها انفصلت عنه بسبب سوء فهم . يجمعهما القدر بعد مرور سنوات وقد أصبحت يوان يوان عارضة أزياء مع اسم مسرحي “إيفا” بينما أصبح دونغ شين رجل أعمال ناجح و طاهٍ . لـيبدأ فصل جديد من قصة حبهما ولكن .. قد لا يسير ذلك كما خُطط له.', 'https://asia2tv.net/wp-content/uploads/2020/04/EOJs0vPU4AYhNBY.jpg', 0, '03/01/2021', 'Judy-Qi : في دور Zhen Yuan Yuan\nDerek-Chang : في دور Ruan Dong Shen\nMa-Meng-Wei : في دور Luo Yi Ren\nQiu-Bai-Hao : في دور Xiao Nan\nZhang-Hao-Jin : في دور Rebecca\nXiao-Ran : في دور Ni Hao', '2KPYrdio2YMg2YPZhdinINij2YbYqiBMb3ZlIFRoZSBXYXkgWW91IEFyZQ==', 'Shen wei yi ge pang zi', '24 حلقة'),
(77, 'عطلة الحب', 'الصين', 'لي يي، الوكيل الذي كان موجودًا منذ بضع سنوات حتى الآن ، ذهب منفرداً في عالم الترفيه و في ليلة رأس السنة ، حضرت الفنانة جاو جونيو إلى المنتجع لتغني ، معتقدة أنها ستجني في النهاية حبًا سعيدًا بعد عشر سنوات من العمل الشاق وتتوالى الأحداث.', 'https://asia2tv.net/wp-content/uploads/2021/02/download.jpg', 0, '03/01/2021', 'Yao-Chen : في دور  Xu Ke Yi\nJohnny-Bai : في دور  Hou Hao\nDa-Peng : في دور  Chen Bin Bin\nZhang-Jing-Chu : في دور  Song Xiao Ke\nGao-Ye : في دور  Tang Xuan\nZheng-Yun-Long : في دور  Gao Jun Yu', '2LnYt9mE2Kkg2KfZhNit2KggVmFjYXRpb24gb2YgTG92ZQ==', 'Warm Holiday', '35 حلقة'),
(78, 'شبابي', 'الصين', 'دراما ويب تروي قصص وجيزة من حياة طلاب في عامهم الدراسي الأول بينما يخوضون مواقف مرحة وأخرى جدية', 'https://asia2tv.net/wp-content/uploads/2021/01/EraysArUUAI8odR.jpg', 0, '03/01/2021', 'Xiao-Jun : في دور  Chang Yan\nXie-Xing-Yang : في دور  Zheng Dian\nHaru-Lu : في دور  Liang Xiao Tang\nBellamy : في دور  Huang Da Chuan', '2YXYsdit2KjYpyDYtNio2KfYqNmKIEhlbGxvIE15IFlvdXRo', 'Welcome High School Students', '20 حلقة'),
(79, 'آنستي العزيزة', 'الصين', 'لو كي وشين سيي فتاتان لهما شخصيات مختلفة، لكنهما أقرب الأصدقاء لبعضهما البعض. عندما تخرجا، انهارت علاقتهم بسبب شخصية شين سيي المسيطرة، لذلك ذهبت شين سيي إلى الولايات المتحدة. بعد تسع سنوات، انهارت حياة لو كي الروتينية والسلمية بسبب عودة شين سيي المفاجئة.', 'https://asia2tv.net/wp-content/uploads/2020/12/gossip-girl-poster1.jpg', 0, '03/01/2021', 'Li-Yi-Tong : في دور  Lu Ke\nGina-Jin : في دور  Shen Si Yi\nJuck-Zhang : في دور  Yao Yuan\nWang-Kai-Ying : في دور  Shi Xiao Tian\nYu-Jie-Qi : في دور  Product Manager\nYang-Guang : في دور  Old Uncle Gu', '2KLZhtiz2KrZiiDYp9mE2LnYstmK2LLYqSBEZWFyIE1pc3N5', 'Gossip Girl , Amazing Girl', '36 حلقة'),
(80, 'الوقوع بحبكِ', 'تايوان', 'تتحدث دراما “الوقوع بحبكِ” عن “جيون جي هيون” الذي يتنكر في هيئة كاتب رحلات، لكنه في الواقع عميل سري للإنتربول. وظيفته كعميل سري هي وسيلة لـ “جيون جي هون” لدعم نفسه ماليًا. هو حاليا مطلق. كان متزوجًا من “كانغ اه ريوم”، لكنهما انفصلا دون معرفة “كانغ آه ريوم” بحياته السرية كجاسوس. تعمل “كانغ آه ريوم” الآن كمصممة فساتين زفاف. قابلت “ديريك هيون” بعد طلاقها وتزوجا في النهاية. يعمل زوجها الحالي كمسؤول دبلوماسي ويبدو لطيفًا ودافئًا. سره هو أنه في الواقع جاسوس صناعي بدم بارد. يعامل “ديريك هيون” زوجته بلطف ، لكن بسبب عمله كجاسوس صناعي، سيفعل أي شيء. إنه يحب “كانغ اه ريوم” بصدق، لكنه أيضًا يخفي نفسه عنها. يظهر العميل السري “جيون جي هون” أمام “كانغ أه ريوم” و”ديريك هيون”.', 'https://asia2tv.net/wp-content/uploads/2020/12/ZQkXO_4f.jpg', 0, '03/01/2021', 'Puff-Kuo : في دور  Chen Zi Tong \nJiro-Wang : في دور  Fang Zhi Sheng\nJessie-Chang : في دور  Fang Qing\nDesmond-Tan : في دور  Chen Tian Lin\nYan-Yu-Lin : في دور  Gao Yu Qian', '2KfZhNmI2YLZiNi5INio2K3YqNmD2ZAgRmFsbGluZyBJbnRvIFlvdQ==', 'يعرف ايضا بـ:', '13 حلقة'),
(81, 'احتجاز', 'التايوان', 'تكشف طالتزيح طالبة مضطربة الستار عن أسرار مقلقة في مدرستها الثانوية النائية، في حين تنقلب حياتها رأسًا على عقب إثر حادثة خيانة ولقاء خارق للطبيعة.بة معذبة عن أسرار مقلقة في مدرستها الثانوية البعيدة مثل الخيانة والمواجهة الخارقة التي تقلب حياتها رأساً على عقب.', 'https://asia2tv.net/wp-content/uploads/2020/12/GPQIQM4JBI2DWJIDF27C3C3CUE.jpg', 0, '03/01/2021', 'Li-Ling-Wei : في دور  Liu Yun Xiang\nHan-Ning : في دور  Fang Rui Xin\nHuang-Guan-Zhi : في دور  Cheng Wen Liang\nJack-Yao : في دور  Shen Hua\nXia-Teng-Hong : في دور  Zhang Ming Hui\nSerena-Fang : في دور  Yin Cui han', '2KfYrdiq2KzYp9iyIERldGVudGlvbg==', 'Fan Xiao , Detention: The Series', '08 حلقات'),
(82, 'نحن سيئون جدا في الحب', 'اليابان', 'تتحدث دراما “شهر العسل في المنزل” عن “فوجيوارا هانا”، فتاة هادئة تتميز باللطف وعدم قدرتها على التعبير عن ما تفكر فيه. يخونها حبيبها ويتخلى عنها، ولا تجد سوى صديقتها المقربة “كاتاياما ميزوكي” كي تقف معها. وتذهبان في رحلة إلى الينابيع الحارة، فتلتقيان بشابين، “ناريتا يوسوكي” و”إيتشينوسي أيومو”. لتقع الصديقتان في حب الشاب نفسه، فما الذي سيحدث يا ترى؟', 'https://asia2tv.net/wp-content/uploads/2020/12/download-1.jpg', 0, '03/01/2021', 'Kawashima-Umika : في دور  Fujiwara Hana\nShirasu-Jin : في دور  Narita Yosuke\nShiono-Akihisa : في دور  Ichinose Ayumu\nAsakawa-Nana : في دور  Katayama Mizuki\nNoro-Kayo : في دور  Hamano Yuri\nOba-Mina : في دور  Sae', '2YbYrdmGINiz2YrYptmI2YYg2KzYr9inINmB2Yog2KfZhNit2KggV2UgQXJlIFRvbyBCYWQgYXQgTG92ZQ==', 'Bokura wa Koi ga Hetasugiru', '07 حلقات'),
(83, 'أسطورة فاي', 'الصين', 'تتحدث دراما “أسطورة فاي” عن البطل “لي هوي” الذي أمره الإمبراطور سرًا قبل عدة سنوات بتشكيل معقل جبلي يتكون من قطاع الطرق من أجل إبقاء عالم الملاكم تحت السيطرة. لتقود ابنته “لي جين رونغ” المعقل بعد وفاة “لي هوي” وأنجبت “تشو فاي” بعد زواجها من العالم “تشو يي تانغ”. دائمًا ما تنتهي محاولات “جو فاي” للهروب بالفشل. فتسمح “لي جين رونغ” أخيرا لابنتها بالذهاب وتجربة العالم في الخارج بعد عيد ميلادها السادس عشر. لتلتقي بـ”شي يون” مرة أخرى بعد أن أنقذها من الغرق أثناء محاولتها الأولى للهروب. وشرعوا في رحلة مغامرة عبر “وولين” معًا.', 'https://asia2tv.net/wp-content/uploads/2020/12/jeWLy_4f.jpg', 0, '03/01/2021', 'Zanilia-Zhao : في دور  Zhou Fei\nWang-Yi-Bo : في دور  Xie Yun / Prince Duan\nZhang-Hui-Wen : في دور  Wu Chu Chu\nChen-Ruo-Xuan : في دور  Li Sheng\nOscar-Sun : في دور  Yin Pei\nZhou-Jie-Qiong : في دور  Li Yan', '2KPYs9i32YjYsdipINmB2KfZiiBMZWdlbmQgb2YgRmVp', 'Bandits', '51 حلقة'),
(84, 'حب للأبد', 'الصين', 'تتحدث دراما “حب للأبد” عن شخصين سعيا للحب من أيام الحرم الجامعي إلى بداياتهما المتواضعة أثناء دخولهما مكان العمل لملاحقة أحلامهما معًا. في السنة الأخيرة كانت “شيا لين شي” مليئة بالإشراق بينما. بينما “جيانغ جينغ هان” كان خطرا. كان يبذل “جيانغ جينغ هان” كل ما في وسعه لكسب المال. وينتهي به الأمر ليصبح مدرسًا لـ”شيا لين شي” التي لا تريد ذلك، ولم تنسى لقاءهما الأول السيء. عندما شعر الاثنان بالحب لأول مرة، كان حلوًا ونقيًا. إنه نوع الحب الذي تريد المجاهرة به للعالم. ولكن لم تصبح مشاعرهم أكثر وضوحًا إلا بعد امتحاناتهم. تمامًا كما أرادوا، تم قبول كل من “شيا لين شي” و”جيانغ جينغ هان” في نفس الجامعة. من شبابهم إلى سن الرشد، من المدرسة إلى مكان العمل، من الزي المدرسي إلى فستان الزفاف، يكون كل منهما رفيقًا مدى الحياة.', 'https://asia2tv.net/wp-content/uploads/2020/12/rXk5E_4f.jpg', 0, '03/01/2021', 'Wang-An-Yu : في دور  Jiang Zheng Han\nXiang-Han-Zhi : في دور  Xia Lin Xi\nChen-Ze : في دور  Chen Yi Chuan\nPan-Mei-Ye : في دور  Gu Xiao Man\nZhao-Hao-Hong : في دور  Zhang Huai Wu\nYuan-Hao : في دور  Qin Yue', '2K3YqCDZhNmE2KPYqNivIEZvcmV2ZXIgTG92ZQ==', 'Bian Nian Zhi Hao', '28 حلقة'),
(85, 'الوقوع في حب القطط', 'الصين', 'قصة حب مليئة بالأزمات لكنها رومانسية تبعث الدفء. من أجل البحث عن منقذ طفولتها ، جاءت سونغ زي ، وهي فتاة من كوكب الققط ، إلى الأرض. أثناء بحثها ، واجهت مشكلة وتلتقي بصاحب متجر الحيوانات الأليفة ، لو وو. قصة حب تتكشف بينهما. بعد المرور بسلسلة من التجارب والمحن ، يعترف الاثنان بمشاعرهما تجاه بعضهما البعض ويتقابلان أخيرًا. ومع ذلك ، يبدو أن هناك تحدٍ أكبر ينتظرهم …', 'https://asia2tv.net/wp-content/uploads/2020/12/vxpJD_4f.jpg', 0, '03/01/2021', 'Vicky-Yu : في دور  Song Zi\nKevin-Chu : في دور  Lu Wu\nMartin-Wong : في دور  Support Role\nMirrre : في دور  Support Role\nZhao-Zhen-Yu : في دور  Support Role\nYou-Xian-Chao : في دور  Support Role', '2KfZhNmI2YLZiNi5INmB2Yog2K3YqCDYp9mE2YLYt9i3IEZhbGxpbmcgSW4gTG92ZSBXaXRoIENhdHM=', 'Lian Shang Miao Xing Ren', '24 حلقة'),
(86, 'موقع فوتمولز', 'تايوان', 'تتحدث دراما “موقع فوتمولز” عن “جاو شو جين” وهو شرطي يحقق عن موقع غريب الذي يدعي أنه من المستقبل. حيث يمكن للزبنائه أن يشتروا أي شيء، من ضمنها الجمال والشهرة والحب. السلع لا ترد، والثمن خيالي. مجموعة من الأشخاص بعد شرائهم سلعًا من الموقع تصيبهم أحداث غريبة. فهل تتحقّق رغباتهم؟ وما هو الثمن؟', 'https://asia2tv.net/wp-content/uploads/2020/12/4YlbY_4f.jpg', 0, '03/01/2021', 'Bryan-Chang : في دور  Zhao Xu Zhen \nEugenie-Liu : في دور  Yang Nian Jun\nBruce-He : في دور  Li Zhong Wei\nIvy-Shao : في دور  Bai Yong Xin\nPhoebe-Lin : في دور  An Zheng Mei', '2YXZiNmC2Lkg2YHZiNiq2YXZiNmE2LIgRnV0bWFsbHMuY29t', 'يعرف ايضا بـ:', '08 حلقات'),
(87, 'أنت لطيف جدا', 'الصين', 'تتحدث دراما “أنت لطيفة جدا” عن “شيي شياو نينغ” وهي فتاة عادية، ليست جميلة بشكل استثنائي ولا هي متعلمة تعليماً عالياً. وهي ممثلة صوت طموحة. بالصدفة حصلت على وظيفة كمساعدة لـ”جو شيان يو” وهو أحد الأفضل في صناعة الدبلجة. ولأن “شياو نينغ” و “جو شيان يو” ليسا متساويين، فإنهما لا يستطيعان التفاهم فيما بينهما. تحاول “تشيا نينغ” أن تجد مكانا لها في العمل. تلتقي “شيي شياو نينغ” بـ”شيي في”، بعد مساعدته في مطاردة كلب. وهو الرئيس التنفيذي المستبد “شيي في”، الذي بدأ في التقرب من “شياو نينغ”. في الوقت نفسه، وضع كل من “شياو نينغ” و “جو شيان يو” خلافاتهما جانبًا بعد أن بدآ يتعرفان على بعض أكثر. مع اثنين من الخاطبين الجذابين يسقطان رأسًا على عقب لها، من ستختار؟', 'https://asia2tv.net/wp-content/uploads/2020/12/Rbx6R_4f-6.jpg', 0, '03/01/2021', 'Eden-Zhao : في دور  Gu Chen Yu\nAmy-Sun : في دور  Xia Xiao Ning\nLi-Xiang-Zhe : في دور  Xie Fei\nMinyee-Chen : في دور  Jin Yao\nDing-Xiao-Ying : في دور  He Yan Ran\nZong-Ying : في دور  Gu Xi Yuan', '2KPZhtiq2ZAg2YTYt9mK2YHYqSDYrNiv2KfZiyBZb3UgQXJlIFNvIFN3ZWV0', 'You Sound Sweet', '24 حلقة'),
(88, 'مطر الحب الأبدي', 'كوريا الجنوبية', '“نينغ شيو روي”، الأمير الثاني لقبيلة التنين، تسلل سراً إلى اليابسة كي يلهو، لكنه واجه جفافاً كبيراً لم يحدث منذ آلاف السنوات. متجاهلاً أوامر والده، جعل المطر يتساقط، وحتى إنه أعطى كنز القبيلة الثمين “ني لين” إلى فتاة تُدعى “جين إر” كي يساعدها في القضاء على الوباء في قرية الصيد التي تعيش فيها. لكن “ني لين” و”جين إر” اختفيا في نفس الوقت بينما تشكّل حاجز فوق البحر، مانعاً “نينغ شيو روي” من العودة إلى المنزل. بعد 500 سنة، يقابل “نينغ شيو روي” “جين إر” ثانيةً، الفتاة التي كرهها طوال هذه السنوات، لتبدأ علاقة حب رومانسية مليئة بالمغامرات والغموض.', 'https://asia2tv.net/wp-content/uploads/2020/12/Eternal-Love-Rain-Chinese-Drama-Airing-Calendar-scaled-1.jpg', 0, '03/01/2021', 'Camille-Hua : في دور  Su Yin Yin\nWang-Run-Ze : في دور  Ning Xiu Rui\nFeng-Li-Jun : في دور  Mo Cheng Feng\nZhu-Li-Lan : في دور  Tang Lin Lin\nKobe-Liu : في دور  Li Ji\nAdson-Liao : في دور  Ning Xiu Ren', '2YXYt9ixINin2YTYrdioINin2YTYo9io2KZiiBFdGVybmFsIExvdmUgUmFpbg==', 'Peerless Rain', '24 حلقة'),
(89, 'شمسي إلى الأبد', 'تايلاند', 'تتحدث دراما “شمسي إلى الأبد” عن “باينج” التي غالبًا ما تسيء التصرف وتتعرض للمشاكل نظرًا لأن والديها لا يحظيان بالوقت والاهتمام لها، ولا يغدقاها إلا بالهدايا المادية. فيستعين والدها، “ثاراتيب”، بـ”أرتيت” لرعايتها أثناء انشغاله. “أرتيت” هو ابن صديقه “كرونج براتيب” الذي يمتلك مزرعة في البلاد. ومع ذلك، يخدعه رجل شرير يدعي “سونجثام” ، المساهم في مزرعة “كرونج براتيب”، ويصر على أنه يجب أن يسدد الدين بتسليم المزرعة. يعفرض “ثاراتيب” مساعدة “كرونج براتيب” و يقرضه المال.\n“ارتيت” هو ابن صاحب مزرعة الشمس المشرقة وصديق لوالد بانغ في أحد الأيام، يأتي والد “بانغ” الثري لمساعدة عائلته لأن والده تعرض للخداع و سيتم مصادرة المزرعة\nفي المقابل ، تتزوج “بانغ” و”آرتيت” بعد موافقة والده وقبوله العرض حيث يشعر بالدين لوالدها، متجاهلاً رفض زوجته وابنه. يتوفي والدا “بانغ” وتنتقل إلى منزل “ارتيت”. ذات ليلة ، مع العلم أنها ستطرد، تحاول اللحاق بوالدتها، لكنها كانت تغضب و يقع حادث. و نتيجة للمأساة ، تذهب “بانغ” بمنحة دراسية مدتها ست سنوات. ماذا سيحدث لعلاقتهما عندما يعودان و يتقابلا من جديد؟ تعود “بانغ” مع فكرة أن الوقت يمكن أن يشفى بعد 6 سنوات؟ لننتظر ونرى ما إذا كان بإمكان ارتيت أن يصبح ملك الشمس لـ وان فامي مرة أخرى.', 'https://asia2tv.net/wp-content/uploads/2020/11/Xz4gZ_3f.jpg', 0, '03/01/2021', 'Mark-Prin-Suparat : في دور  Arthit Suriyakkul\nKao-Supassara-Thanachart : في دور  Wanfahmai Warawit / Paeng\nPanjan-Kawin-Imanothai\nMam-Jintara-Sukapat\nDuke-Phanudet-Watnasuchart\nFreud-Chatphong-Natthaphong', '2LTZhdiz2Yog2KXZhNmJINin2YTYo9io2K8gTXkgRm9yZXZlciBTdW5zaGluZQ==', 'طالما الشمس فى السماء / As Long as the Sky Has The Sun', '19 حلقة'),
(90, 'أنت لطيف جدا', 'كوريا الجنوبية', 'اسم المسلسل :  You Are So Sweet الاسم العربي :  أنت لطيف جدا يعرف أيضا بـ :  You Sound Sweet النوع :  رومانسي، كوميدي، درامي عدد الحلقات :  24 حلقة البلد المنتج :  كوريا الجنوبية شبكة العرض :  Youku موعد البث :  من 05 نوفمبر إلى 21 نوفمبر 2020 أيام العرض :  الخميس والجمعة والسبت', 'https://asia2tv.net/wp-content/uploads/2020/11/Rbx6R_4f.jpg', 0, '03/01/2021', 'Eden-Zhao : في دور  Gu Chen Yu Amy-Sun : في دور  Xia Xiao Ning Li-Xiang-Zhe : في دور  Xie Fei Minyee-Chen : في دور  Jin Yao Ding-Xiao-Ying : في دور  He Yan Ran Zong-Ying : في دور  Gu Xi Yuan', '2YvYo9mG2KrZkCDZhNi32YrZgdipINis2KYpyBZb3UgQXJlIFNvIFN3ZWV0', 'You Sound Sweet', '24 حلقة'),
(91, 'حبيبتي العاشقة للدراما', 'كوريا الجنوبية', 'تتحدث دراما “حبيبتي العاشقة للدراما” عن “شيان جين جين” وهي كاتبة حديثة من الدرجة الثالثة، التي دخلت داخل أحداث روايتها غير المكتملة عن طريق الخطأ، وأصبحت دورًا مكيدًا ولكن غير مهم في قصتها. من أجل تغيير مصيرها، تعاونت مع الرجل رقم ثلاثة في الرواية، مساعدها الشخصي لو لي، لبدء رحلة الهجوم المضاد. وهي أخيراً حصدت الحب بنجاح. ومع ذلك، عندما انتهت الرواية، كان على الكاتبة أن تعود إلى الواقع. فهل سينتهي هذا الحب الذي يمتد عبر الزمان والمكان؟', 'https://asia2tv.net/wp-content/uploads/2020/11/Rbwqg_4f.jpg', 0, '03/01/2021', 'Zhu-Li-Zhen : في دور  Qian Zhen Zhen\nZhang-Meng : في دور  Lu Li\nClaire-Jia : في دور  Li Chun Xi', '2K3YqNmK2KjYqtmKINin2YTYudin2LTZgtipINmE2YTYr9ix2KfZhdinIE9oIE15IERyYW1hIExvdmVy', 'Love Beyond Time and Space', '24 حلقة'),
(92, 'ابدأ مجدداً', 'كوريا الجنوبية', 'تتحدث دراما “ابدأ مجدداً” عن مديرة تنفيذية مسيطرة وطبيب دافئ يحولان علاقة وهمية إلى حقيقة لأسباب عملية. بعد أن تبادلوا “موافق” ، بدأوا فصلاً جديدًا من حياتهم حيث يتعلمون الوقوع في الحب.\n“لو فانغ نينغ” هي المدير العام لمجموعة “لو نينغ” ، وهي شركة كبيرة في مجال تجارة الأثاث المنزلي. “لو فانغ نينغ” امرأة لديها كل شيء، موهوبة وجميلة وغنية. بعد اقترابها من الثلاثينيات، تخضع لضغوط الأسرة وتقرر أنها بحاجة ماسة إلى زوج لتنجب معه طفلًا. من قبيل الصدفة، يظهر الجراح “لينغ روي” أمامها. وهو لا ينعم بمظهر جميل فحسب، بل يتمتع أيضًا بقلبا أبيضا كالملاك، مما يجعله المرشح المثالي في عيون “لو فانغ نينغ”. خططت طريقها إلى حياته وأصبحا أخيرًا زوجًا وزوجة. تدرك “لو فانغ نينغ” في النهاية الخطأ في طرقها وتسعى جاهدة لتكون أفضل. ومع ذلك، فإن الحفاظ على الزواج ليس سهلاً كما يبدو.', 'https://asia2tv.net/wp-content/uploads/2020/11/08o4k_4f.jpg', 0, '03/01/2021', 'Zhou-Yu-Tong : في دور  Lu Fang Ning\nSimon-Gong : في دور  Ling Rui\nGarvey-Jin : في دور  Lu Yi Yao\nWu-Man-Si : في دور  Cai Si Yu\nLi-Si-Qi : في دور  Tang Ping\nShawn-Zhang : في دور  Gao Er Fan', '2KfYqNiv2KMg2YXYrNiv2KYp9mLIEJlZ2luIEFnYWlu', 'We Started Dating From Marriage', '35 حلقة'),
(93, 'الجريمة الصامتة', 'كوريا الجنوبية', 'خلال تسعة عشرة عاما ارسل فنغ باو الزعيم زان عدة مرات الى العاصمة للاستقصاء عن مكان سلاح “دا يبين تويا” وقد استطاعوا اقتحام قصر الامير روي ليتوجهوا مباشرة نحو دا يين تويا ليكتشفوا ان الامبرطور السابق قد اهدى دا يين تويا للجنرال باي جيانغ منذ فترة طويلة. وصل الحارس الامبراطوري لونغ ياو ومعه الحارس الامبراطوري لي يو لتقديم المساعدة وقاموا بقتل رجال الزعيم وان. ومع ذلك قام وانغ سو ابن الجنرال باي جيانغ ذو الشخصية سريعة الغضب بقتل لي يو متدعيا ان سهم طائش قد اصابه دون قصد داخل حديقة الصيد. وقد وكل القاضي ليو الشرطي شي جينغ ياو لحل هذه القضية.', 'https://asia2tv.net/wp-content/uploads/2020/11/j342r_3f.jpg', 0, '03/01/2021', 'Leo-Li : في دور  Shi Jing Yao\nWen-Sheng : في دور  Long Yao\nFu-Shu-Yang : في دور  Chen Xing Yi\nLan-Maeva : في دور  Li Huang Wu\nMeng-Zi-Di : في دور  Ma Song\nWang-Zi-Xin : في دور  Zhao Shan He', '2KfZhNis2LHZitmF2Kkg2KfZhNi12KfZhdiq2KkgVGhlIFNpbGVudCBDcmltaW5hbA==', 'Battle of No Master', '13 حلقة'),
(94, 'وقعت في الحب بالصدفة', 'الصين', 'تتحدث دراما “وقعت في الحب بالصدفة” عن “تشنغ مينوي” الذي كان مهووس بعمل شركة الإعلانات، وهو عازب لفترة طويلة. لذلك لم يُجبره والديه على الزواج بعنف فحسب، بل ناقشه أيضًا زملائه. فقام مدير الشركة بترتيب خدمات الاستشارة العاطفية له بشكل خاص بدافع القلق – على أمل إنهاء حياته العزوبية. بهذه الطريقة، دخلت “أن ران”، عالمة النفس العاطفي حياة “تشنغ مينوي”، و بدأت مشاعرهما تجاه بعضهما البعض تدريجيا.', 'https://asia2tv.net/wp-content/uploads/2020/11/r33qE_4f.jpg', 0, '03/01/2021', 'Xu-Le-Wei : في دور  Zheng Min Wei \nYe-Yu-Jun : في دور  An Ran\nLiu-Si-Qian\nLi-Mu-Yun', '2YjZgti52Kog2YHZiiDYp9mE2K3YqCDYqNin2YTYtdiv2YHYqSBBY2NpZGVudGFsbHkgRmVsbCBJbiBMb3Zl', 'يعرف ايضا بـ:', '12 حلقة');
